(14,	0,	'Mở bán đợt cuối 30 nền KDC Gia Hoà, MT Đỗ Xuân Hợp, Q9. Chỉ 2,2tỷ/nền - 100m2, SHR 0988883110 Khang',	'Dự án Gia Hòa Quận 9 cách trung tâm thành phố',	'<p>Dự &aacute;n Gia H&ograve;a Quận 9 c&aacute;ch trung t&acirc;m th&agrave;nh phố 9km, qu&yacute; kh&aacute;ch chỉ mất 15 - 20 ph&uacute;t chạy xe đến trung t&acirc;m th&agrave;nh phố. Dự &aacute;n sở hữu vị tr&iacute; đắc địa với.<br />\r\n<br />\r\n- Hướng T&acirc;y Nam tiếp gi&aacute;p với đường Đỗ Xu&acirc;n Hợp (lộ giới quy hoạch 30m gi&aacute;p ranh quận 2) v&agrave; c&aacute;ch s&acirc;n Golf Quận 2 khoảng 500m;<br />\r\n<br />\r\n- Hướng Đ&ocirc;ng Nam tiếp gi&aacute;p s&ocirc;ng Rạch Chiếc - con s&ocirc;ng nằm trong dự &aacute;n ph&aacute;t triển du lịch của th&agrave;nh phố Hồ Ch&iacute; Minh;<br />\r\n<br />\r\n- Dự &aacute;n đối diện Trung t&acirc;m thể dục thể thao Rạch Chiếc, c&aacute;ch khu C&ocirc;ng Nghệ Cao gần 500m, c&aacute;ch đường cao tốc TP.HCM - Long Th&agrave;nh - Dầu Gi&acirc;y khoảng 1km; Nằm trong khu d&acirc;n cư hiện hữu sầm uất, gần trường mẫu gi&aacute;o, trường cao đẳng, nh&agrave; thờ, ch&ugrave;a v&agrave; đối diện UBND phường Phước B&igrave;nh.<br />\r\n<br />\r\nC&oacute; lẽ hiếm c&oacute; dự &aacute;n n&agrave;o m&agrave; phần thiết kế được nh&agrave; đầu tư chăm ch&uacute;t kỹ lưỡng v&agrave; đặt l&ecirc;n h&agrave;ng đầu như thế, cho d&ugrave; l&agrave; từng chi tiết nhỏ cũng lột tả được sự tiện &iacute;ch v&agrave; t&iacute;nh chuẩn x&aacute;c. Lợi thế kh&aacute;c của dự &aacute;n l&agrave; gi&aacute;p s&ocirc;ng Rạch Chiếc - con s&ocirc;ng nằm trong dự &aacute;n ph&aacute;t triển du lịch của TP. HCM hiện đang được cải tạo lại m&ocirc;i trường nước, hứa hẹn một cảnh quan sinh động cho to&agrave;n khu.<br />\r\n<br />\r\n- Mặt tiền đường Li&ecirc;n Phường D5 (Lộ giới 30m).<br />\r\n- C&aacute;ch trung t&acirc;m Quận 1 khoảng 9km, bằng 15 ph&uacute;t đi xe gắn m&aacute;y.<br />\r\n- Gần khu C&ocirc;ng Nghệ Cao TP.HCM v&agrave; cả nước (quy m&ocirc; 9.300.000 m2).<br />\r\n- Gần đường cao tốc Vũng T&agrave;u - Long Th&agrave;nh (Lộ giới 120m.<br />\r\n- Gần khu TDTT Rạch Chiếc.<br />\r\n<br />\r\n- Trong b&aacute;n k&iacute;nh 2km đầy đủ tiện &iacute;ch như: Chợ Phước Long B, trường cao đẳng C&ocirc;ng Thương, TTTM Vincom, si&ecirc;u thị Coop Mart...<br />\r\n- Đường trước nh&agrave; 12m. Khu d&acirc;n cư cao cấp tr&iacute; thức nhất Quận 9.<br />\r\n- Khu an ninh cao được bảo vệ 24/24.<br />\r\nVị tr&iacute; thuận tiện ngay đường Đỗ Xu&acirc;n Hợp, Dương Đ&igrave;nh Hội, Xa lộ V&agrave;nh Đai Trong.<br />\r\n- Nơi c&oacute; hạ tầng giao th&ocirc;ng thuận lợi, về trung t&acirc;m TP bằng cao tốc v&agrave; đường Mai Ch&iacute; Thọ, về Q7 theo đường V&otilde; Ch&iacute; C&ocirc;ng chỉ mất 15 ph&uacute;t. C&aacute;ch khu c&ocirc;ng nghệ cao SamSung, Aeon Mall chỉ 2km...<br />\r\n- Khu trung t&acirc;m ăn uống, giải tr&iacute;, thẩm mỹ viện (Spa).<br />\r\nTiện &iacute;ch:<br />\r\n+ Khu d&acirc;n cư an ninh đ&ocirc;ng đ&uacute;c.<br />\r\n+ Giao th&ocirc;ng thuận lợi.<br />\r\n+ Gần chợ, si&ecirc;u thị, trường học, bệnh viện.<br />\r\n+ Đường phố rộng tho&aacute;ng.<br />\r\n+ Th&iacute;ch hợp để sống định cư, v&agrave; kinh doanh hoặc đầu tư sinh lời.<br />\r\n+ Đất thổ cư 100%, x&acirc;y dựng tự do đ&atilde; t&aacute;ch sổ hồng ri&ecirc;ng từng nền.<br />\r\nPh&aacute;p l&yacute;:<br />\r\n+ Sổ hồng ch&iacute;nh chủ, thủ tục đơn giản, bao sang t&ecirc;n c&ocirc;ng chứng.<br />\r\n+ Gi&aacute; chỉ 1,6 tỷ/nền.<br />\r\n+ Ng&acirc;n h&agrave;ng hỗ trợ 60%.<br />\r\nLH 0988883110 Khang.</p>\r\n',	'2 TỶ',	'',	'34',	'',	' KDC Gia Hoà, MT Đỗ Xuân Hợp, Q9. Chỉ 2,2tỷ/nền - 100m2, SHR 0988883110 Khang',	'',	'0988883110 ',	'',	'bds23.jpg',	'',	0,	0,	0,	0,	0,	0,	28,	'Mở bán đợt cuối 30 nền KDC Gia Hoà, MT Đỗ Xuân Hợp, Q9. Chỉ 2,2tỷ/nền - 100m2, SHR 0988883110 Khang',	'',	'2019-06-23',	1,	'',	'',	'',	0,	0,	'0000-00-00',	'',	'',	'',	'',	'',	'',	'',	'',	'',	0,	0,	0,	'',	'',	'',	'',	'',	'',	1,	0),
