(70,	592940,	'CHÍNH CHỦ CẦN BÁN ĐẤT TÁI ĐỊNH CƯ XI MĂNG - SỐ 1 LÔ 34 SỞ DẦU, HỒNG BÀNG, HẢI PHÒNG',	'CHÍNH CHỦ CẦN BÁN ĐẤT TÁI ĐỊNH CƯ XI MĂNG - SỐ 1 LÔ 34 SỞ DẦU, HỒNG BÀNG, HẢI PHÒNG<br />\r\n',	'<p><span style=\"font-family:tahoma,geneva,sans-serif; font-size:14px\">- L&ocirc; đất nằm trong khu T&aacute;i Định Cư đối diện với dự &aacute;n Vinhomes Imperia Hải Ph&ograve;ng, l&ocirc; g&oacute;c hai mặt tiền vị tr&iacute; đẹp nhất dự &aacute;n, đất vu&ocirc;ng vắn đẹp c&oacute; thể thiết kế theo mục đ&iacute;ch sử dụng: Shophouse 2 mặt tiền hoặc biệt thự, villa,... nằm trong khu d&acirc;n cư đ&ocirc;ng đ&uacute;c, an ninh an to&agrave;n tuyệt đối, khu d&acirc;n cư văn minh, giao th&ocirc;ng thuận tiện, gần ngay chợ Đầu Mối hoa quả lớn nhất Hải Ph&ograve;ng, đi bộ ra trung t&acirc;m thương mại Vinhomes khoảng 3 ph&uacute;t</span><br />\r\n<span style=\"font-family:tahoma,geneva,sans-serif; font-size:14px\">- Mặt tiền rộng hơn 7m, vị tr&iacute; đẹp thuận lợi c&oacute; thể kinh doanh bu&ocirc;n b&aacute;n c&aacute;c mặt h&agrave;ng hoặc mở văn ph&ograve;ng, đất sạch phong thủy tốt, hai mặt tiền rộng tho&aacute;ng, đa mục đ&iacute;ch sử dụng, hứa hẹn nhiều tiềm năng kinh tế trong tương lai, d&ugrave; để ở hay kinh doanh bu&ocirc;n b&aacute;n đều đẹp.</span><br />\r\n<span style=\"font-family:tahoma,geneva,sans-serif; font-size:14px\">- Cơ sở hạ tầng đồng bộ, đường nội bộ rộng 34m, một mặt đường 11m, vỉa h&egrave; 2,5m, hệ thống điện v&agrave; nước được lắp đặt đồng bộ theo c&ocirc;ng nghệ hiện đại nhất.</span></p>\r\n',	'2,5 tỷ',	'',	'90',	'',	' Số 1 Lô 34 Sở Dầu, Hồng Bàng, Hải Phòng',	'',	'0978898989',	'',	'109520190724141240-f81c_wm.jpg',	'109520190724141240-f81c_wm1.jpg',	0,	0,	0,	1,	0,	1,	7,	'',	'',	'2019-07-30',	1,	'',	'',	'',	0,	0,	'0000-00-00',	'7',	'0',	'',	'0',	'',	'',	'',	'',	'',	0,	0,	0,	'',	'',	'',	'',	'',	'',	1,	0),
