(72,	588463,	'Bán nhà 50m2 đường Phương Lưu, Hải An, Hải Phòng',	'Bán nhà 50m2 đường Phương Lưu, Hải An, Hải Phòng<br />\r\n',	'<p>Mở b&aacute;n d&atilde;y nh&agrave; 31 căn hộ đồng bộ trong khu nh&agrave; ở Phương Lưu, Hải An, Hải Ph&ograve;ng</p>\r\n\r\n<p>D&atilde;y 3.5 tầng gi&aacute; tầm 1.7 tỷ</p>\r\n\r\n<p>D&atilde;y 4 tầng gi&aacute; tầm 1.85 tỷ</p>\r\n\r\n<p>Nh&agrave; c&oacute; cấu tr&uacute;c: 1 ph&ograve;ng kh&aacute;ch, 1 bếp, 4 ph&ograve;ng ngủ, 3 vệ sinh, ph&ograve;ng thờ, s&acirc;n phơi, s&acirc;n chơi</p>\r\n\r\n<p>Trong khu nh&agrave; c&oacute; gara gửi &ocirc; t&ocirc; ngay cạnh, sinh hoạt đi lại thuận tiện. Gần BigC, Parkson, trường học Trần Ph&uacute; 3</p>\r\n\r\n<p>Sổ đỏ ch&iacute;nh chủ. Cấp ph&eacute;p x&acirc;y dựng đầy đủ.</p>\r\n\r\n<p>H&atilde;y li&ecirc;n hệ mới với ch&uacute;ng t&ocirc;i để được tư vấn v&agrave; chọn những căn đẹp nhất v&agrave; gi&aacute; ưu &aacute;i nhất</p>\r\n\r\n<div class=\"brief_land_box\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">\r\n<div class=\"row ibrief\" style=\"box-sizing: border-box; margin: 0px; padding: 5px 10px; border-width: 1px 0px 0px; border-top-style: solid; border-right-style: initial; border-bottom-style: initial; border-left-style: initial; border-top-color: rgb(217, 217, 217); border-right-color: initial; border-bottom-color: initial; border-left-color: initial; border-image: initial; background: rgb(246, 246, 246); line-height: 24px;\">&nbsp;</div>\r\n</div>\r\n',	'1.7 tỷ',	'',	'90',	'',	'hải phòng',	'',	'0988282986',	'',	'721.png',	'72.png',	0,	0,	0,	0,	0,	1,	38,	'',	'',	'2019-07-30',	1,	'',	'',	'',	0,	0,	'0000-00-00',	'7',	'0',	'',	'0',	'Hải Phòng',	'',	'',	NULL,	'',	0,	1,	0,	'',	'',	'',	'',	'',	'',	1,	0),
