(90,	623354,	'Liên hệ tư vấn và xem nhà trực tiếp miễn phí:',	'(64m2 x 5 tầng x 4m), giá ,5.1 tỷ.<br />\r\nngã tư sở đống đa hà nội',	'<p>Li&ecirc;n hệ tư vấn v&agrave; xem nh&agrave; trực tiếp miễn ph&iacute;: 0796432211</p>\r\n\r\n<p>Do hết tuổi c&ocirc;ng t&aacute;c muốn chuyển l&ecirc;n T&acirc;y Hồ ở c&ugrave;ng con ch&aacute;u cho vui cửa vui nh&agrave;, n&ecirc;n cần b&aacute;n gấp nh&agrave; ri&ecirc;ng tại ng&atilde; tư sở.</p>\r\n\r\n<p>(64m2 x 5 tầng x 4m), gi&aacute; ,5.1 tỷ.</p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px;\">\r\n<p>Nh&agrave; rất mới, x&acirc;y dựng được 2 năm rất chắc chắn v&agrave; t&acirc;m huyết. Với thiết kế tầng lệch, cầu thang giữa hợp l&yacute; chắc chắn&hellip;</p>\r\n\r\n<p>Trước nh&agrave; cực tho&aacute;ng. C&oacute; s&acirc;n để c&aacute;c ch&aacute;u nhỏ c&oacute; thể vui chơi v&agrave; sinh hoạt. vị tr&iacute; cực đẹp 3 mặt tho&aacute;ng vĩnh viễn, ng&otilde; ba g&aacute;c đua nhau.</p>\r\n\r\n<p>+ Tầng 1: để xe, ph&ograve;ng kh&aacute;ch, bếp, wc.</p>\r\n\r\n<p>+ Tầng 2,3,4: Mỗi tầng 2 ph&ograve;ng ngủ rộng, wc.</p>\r\n\r\n<p>+ Tầng 5: Ph&ograve;ng thờ, s&acirc;n phơi, khu trồng rau sạch, s&acirc;n thượng lớn.</p>\r\n\r\n<p>Nội thất do chủ tự tay thiết kế n&ecirc;n rất ki&ecirc;n cố. chủ nh&agrave; để lại to&agrave;n bộ nội thất cho kh&aacute;ch.</p>\r\n\r\n<p>- Nh&agrave; gần rất nhiều tiện &iacute;ch như trường Cấp 1,2,3, c&aacute;ch chợ nh&agrave; v&agrave;i bước ch&acirc;n, gần c&aacute;c TTTM, vincom, Royal city&hellip;</p>\r\n\r\n<p>Sổ đỏ ch&iacute;nh chủ, kh&ocirc;ng tranh chấp, vu&ocirc;ng đẹp, kh&ocirc;ng lỗi phong thủy.</p>\r\n\r\n<p>Khu d&acirc;n tr&iacute; cao, h&agrave;ng x&oacute;m th&acirc;n thiện, l&agrave; nơi đ&aacute;ng sống nhất khu vực.</p>\r\n</div>\r\n',	'5.1 tỷ.',	'',	'64',	'64',	'ngã tư sở hà nội',	'',	'0796432211',	'',	'90main.jpg',	'69290006_124133278914228_374246386268372992_n.jpg#69468391_1