(91,	206862,	'Chính chủ cần ban nhà ngõ 908 đường Kim Giang, Mặt tiền lớn, ô tô tránh, đỗ.',	'+ Gần công viên Chu Văn An, KĐT Đại Thanh.<br />\r\n<br />\r\n+ Ngõ trước nhà ô tô dừng đỗ, ô tô vào nhà',	'<p>Ch&iacute;nh chủ cần ban nh&agrave; ng&otilde; 908 đường Kim Giang, Mặt tiền lớn, &ocirc; t&ocirc; tr&aacute;nh, đỗ.</p>\r\n\r\n<p>+ Diện t&iacute;ch 73m2, 4 tầng, &ocirc; t&ocirc; v&agrave;o nh&agrave;. Nội thất chủ nh&agrave; để lại 90%. Chỉ đem đồ kỷ niệm đi.</p>\r\n\r\n<p>+ Nh&agrave; tự x&acirc;y 4 tầng,tho&aacute;ng trước sau. Thiết kế tầng 2 ph&ograve;ng ngủ, s&agrave;n gỗ, thiết bị vệ sinh cao cấp, nh&agrave; tho&aacute;ng m&aacute;t chủ để to&agrave;n bộ nội thất, chỉ mang tivi v&agrave; bộ amli l&agrave; đổ kỉ niệm.</p>\r\n\r\n<div class=\"text_exposed_show\" style=\"display: inline; font-family: Helvetica, Arial, sans-serif; color: rgb(29, 33, 41); font-size: 14px;\">\r\n<p>+ C&aacute;ch 100m l&agrave; hồ Thanh Liệt rất rộng v&agrave; đẹp. Nh&agrave; gần đường 25 kết nối thẳng ra đường v&agrave;nh đai 3 giao th&ocirc;ng rất thuận tiện.</p>\r\n\r\n<p>+ Gần c&ocirc;ng vi&ecirc;n Chu Văn An, KĐT Đại Thanh.</p>\r\n\r\n<p>+ Ng&otilde; trước nh&agrave; &ocirc; t&ocirc; dừng đỗ, &ocirc; t&ocirc; v&agrave;o nh&agrave;</p>\r\n\r\n<p>+ Li&ecirc;n hệ: 0796432211</p>\r\n</div>\r\n',	'2 triệu / m2',	'',	'73',	'73',	'nhà ngõ 908 đường Kim Giang,',	'',	'0796432211',	'',	'91main.jpg',	'69467760_362183054711128_6869108725987147776_n.jpg#69697716_362183041377796_6781265172926300160_n.jpg',	0,	0,	0,	1,	0,	1,	48,	'',	'',	'2019-08-27',	1,	'',	'',	'',	0,	0,	'0000-00-00',	'2',	'52',	'848',	'0',	'Hà Nội',	'Thanh Xuân',	'Kim Giang',	NULL,	'',	1,	1,	0,	'',	'',	'',	'',	'',	'',	1,	0),
