(104,	541551,	'Quan Nhân ( có thể di đường Lê Văn Lương )',	'Dt 44m x4 t<br />\r\nMt:4 m <br />\r\nGiá 5ty290 Thanh Xuân ',	'<p><span style=\"color:rgb(0, 0, 0); font-family:tahoma,sans-serif,arial,helvetica\">Quan Nh&acirc;n ( c&oacute; thể di đường L&ecirc; Văn Lương )</span><br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,sans-serif,arial,helvetica\">Dt 44m x4 t</span><br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,sans-serif,arial,helvetica\">Mt:4 m </span><br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,sans-serif,arial,helvetica\">Gi&aacute; 5ty290 Thanh Xu&acirc;n </span><br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,sans-serif,arial,helvetica\">M&ocirc; tả:</span><br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,sans-serif,arial,helvetica\">+ &Ocirc; t&ocirc; tr&aacute;nh c&aacute;ch nh&agrave; 50m, khu vực đ&ocirc;ng d&acirc;n cư, gần chung cư, người d&acirc;n đi lại nhộn nhịp.</span><br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,sans-serif,arial,helvetica\">+ Nh&agrave; ngay cạnh nh&agrave; Văn h&oacute;a, n&ecirc;n từ tầng 2 trở l&ecirc;n l&agrave; 2 mặt tho&aacute;ng.</span><br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,sans-serif,arial,helvetica\">+ Nh&agrave; đẹp, x&acirc;y dựng chắc chắn v&ocirc; c&ugrave;ng. Thiết kế hiện đại, bắt mắt.</span><br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,sans-serif,arial,helvetica\">- T1: Để xe + Ph&ograve;ng bếp.</span><br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,sans-serif,arial,helvetica\">- T2: Ph&ograve;ng kh&aacute;ch + Ph&ograve;ng ngủ.</span><br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,sans-serif,arial,helvetica\">- T3: 2 ph&ograve;ng ngủ.</span><br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,sans-serif,arial,helvetica\">- T4: Ph&ograve;ng thờ + s&acirc;n phơi.</span><br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,sans-serif,arial,helvetica\">+ Đồ d&ugrave;ng trong nh&agrave; to&agrave;n đồ xịn: quạt, điều h&ograve;a, bếp từ, ... cứ đồ điện tử l&agrave; Made in Japan hết. Đồ gỗ to&agrave;n l&agrave;m bằng gỗ thịt: lim, xoan, ... d&ugrave;ng cả đời kh&ocirc;ng bị hỏng.</span><br />\r\n<span style=\"color:rgb(0, 0, 0); font-family:tahoma,sans-serif,arial,helvetica\">+ Chủ nh&agrave; cực k&yacute; hợp t&aacute;c, b&aacute;n nh&agrave; đi về ở nh&agrave; to hơn với bố mẹ.</span></p>\r\n',	'5 tỷ 290 triệu',	'',	'176',	'704',	'quan nhân, thanh xuân, hà nội',	'',	'0796432211',	'',	'5f60b290-f0ab-4782-866e-c50bce1d251b.jpg',	'0bdeda81-d686-4225-91ed-251458ead7dc.jpg#0ee1cbf1-1936-41a6-a058-53265853cb09.jpg#070ef82a-d92e-40c1-b882-cc9002a76954.jpg#88ebd7e4-706a-4261-b6b0-97b27a2b19d8.jpg#0129f5a9-7739-4f44-9ad0-8d55cce8f67e.jpg#953a97c9-1407-4adc-8ead-3ef35017fcb8.jpg#3470b262-5c19-4ae8-8760-95a4f6fa4df7.jpg#5720aa58-fad7-4770-85ce-fe5369bc3c53.jpg',	0,	0,	0,	0,	0,	0,	99,	'',	'',	'2019-09-26',	1,	'',	'',	'',	0,	0,	'0000-00-00',	'2',	'52',	'847',	'9469',	'Hà Nội',	'Thanh Xuân',	'Khương Trung',	'Quan Nhân',	'',	1,	1,	0,	'44',	'4',	'',	'',	'',	'',	1,	0),
