(111,	958014,	'NHÀ MỚI - MẶT PHỐ - KINH DOANH ĐỈNH - VỈA HÈ RỘNG - 55M2 - 6 TẦNG - GIÁ CẢ THƯƠNG LƯỢNG',	'Lê đại hành - Hai bà trưng - Hà nội<br />\r\nTầng 1,2,3 : Đang để thông sàn kinh doanh hoặc ở hoặc cho thuê tùy ý.',	'<p><span style=\"color:rgb(28, 30, 33); font-family:helvetica,arial,sans-serif; font-size:12px\">Nh&agrave; x&acirc;y mới thiết kế hiện đại. Giao th&ocirc;ng thuận tiện. &Ocirc; t&ocirc; đi lại thoải m&aacute;i. Kinh doanh đa dạng mọi loại h&igrave;nh. </span></p>\r\n\r\n<p><span style=\"color:rgb(28, 30, 33); font-family:helvetica,arial,sans-serif; font-size:12px\">Tầng 1,2,3 : Đang để th&ocirc;ng s&agrave;n kinh doanh hoặc ở hoặc cho thu&ecirc; t&ugrave;y &yacute;.</span></p>\r\n\r\n<p><span style=\"color:rgb(28, 30, 33); font-family:helvetica,arial,sans-serif; font-size:12px\">Tầng 4,5 : Mỗi tầng 2 ph&ograve;ng + WC hiện đại. Tầng 6 : Ph&ograve;ng thờ + S&acirc;n phơi. </span></p>\r\n\r\n<p><span style=\"color:rgb(28, 30, 33); font-family:helvetica,arial,sans-serif; font-size:12px\">Tọa lạc ngay mặt phố sầm uất. D&acirc;n cư xung quanh văn minh, an ninh tốt vệ sinh sạch sẽ.</span></p>\r\n\r\n<p><span style=\"color:rgb(28, 30, 33); font-family:helvetica,arial,sans-serif; font-size:12px\">Sổ đỏ r&otilde; r&agrave;ng ch&iacute;nh chủ. G&iacute;a cả thương lượng hợp l&yacute; chỉ cần kh&aacute;ch thật sự hiểu về thị trường nh&agrave; đất v&agrave; c&oacute; thiện ch&iacute; mua nh&agrave;. Chi tiết li&ecirc;n hệ&nbsp;</span></p>\r\n',	'liên hệ',	'',	'55',	'275',	'Lê đại hành - Hai bà trưng - Hà Nội',	'',	'0796432211',	'',	'71084706_391956181502359_3792690962589810688_n.jpg',	'70675088_391956728168971_2689549043771637760_n.jpg#70825312_391956228169021_2393760203783798784_n.jpg#70879745_391956161502361_5370260243143983104_n.jpg#70879745_391956204835690_6185251457453785088_n.jpg',	0,	0,	0,	0,	0,	0,	27,	'',	'',	'2019-09-28',	1,	'',	'',	'',	0,	0,	'0000-00-00',	'2',	'35',	'534',	'0',	'Hà Nội',	'Hai Bà Trưng',	'Lê Đại Hành',	NULL,	'',	1,	0,	0,	'5',	'