(120,	644748,	'Bán nhà sổ đỏ chính chủ tại Đức Giang, Long Biên, Hà Nội.',	'Diện tích 33,3m2 mặt tiền 5,5m\r\n- Hướng nhà : Tây Bắc',	'<p><span style=\"color:rgb(28, 30, 33); font-family:helvetica,arial,sans-serif; font-size:14px\">NH&Agrave; QU&Aacute; ĐẸP, GI&Aacute; QU&Aacute; HỢP L&Yacute;, CẦN B&Aacute;N RẤT GẤP,</span><br />\r\n<span style=\"color:rgb(28, 30, 33); font-family:helvetica,arial,sans-serif; font-size:14px\">B&aacute;n nh&agrave; sổ đỏ ch&iacute;nh chủ tại Đức Giang, Long Bi&ecirc;n, H&agrave; Nội.</span><br />\r\n<span style=\"color:rgb(28, 30, 33); font-family:helvetica,arial,sans-serif; font-size:14px\">- Do nhu cầu c&ocirc;ng việc phải chuyển chỗ ở. Chứ thực em cũng tiếc lắm . Nh&agrave; gọn ghẽ xinh xắn . CHỈ VIỆC X&Aacute;CH QUẦN &Aacute;O VỀ .</span><br />\r\n<span style=\"color:rgb(28, 30, 33); font-family:helvetica,arial,sans-serif; font-size:14px\">Diện t&iacute;ch 33,3m2 mặt tiền 5,5m</span><br />\r\n<span style=\"color:rgb(28, 30, 33); font-family:helvetica,arial,sans-serif; font-size:14px\">- Hướng nh&agrave; : T&acirc;y Bắc</span><br />\r\n<span style=\"color:rgb(28, 30, 33); font-family:helvetica,arial,sans-serif; font-size:14px\">Tầng 1 l&agrave; 1 ph&ograve;ng kh&aacute;ch, nh&agrave; vệ sinh , khu bếp gọn g&agrave;ng xinh xắn lu&ocirc;n &yacute; ạ.<br />\r\nTầng 2 ph&ograve;ng ngủ lớn v&agrave; 1 nh&agrave; vệ sinh.<br />\r\nTầng 3 : 1 ph&ograve;ng ngủ nhỏ 1 ph&ograve;ng thờ v&agrave; s&acirc;n phơi . Xung quanh l&agrave;m bằng th&eacute;p ko gỉ lợp t&ocirc;n lạnh , m&aacute;i chống n&oacute;ng .<br />\r\n- Ng&otilde; trước nh&agrave; 2m c&aacute;ch v&agrave;i bước ch&acirc;n ra đường 2 oto tr&aacute;nh . Gần nh&agrave; c&oacute; b&atilde;i giữ xe lớn . C&aacute;ch trung cư đang x&acirc;y dựng 300m . C&aacute;ch trường tiểu học Đức Giang chợ 500-800m . C&aacute;ch bệnh viện Đức Giang 2km . - Nh&agrave; ấm &aacute;p , ph&ugrave; hợp với vợ chồng trẻ với 2 đứa con như nh&agrave; em . gi&aacute; 1,7 tỷ<br />\r\nĐể to&agrave;n bộ đồ l