(134,	888768,	'CẦN BÁN NHÀ CHÍNH CHỦ  Liên hệ chính chủ: 0937 535 448',	'',	'<p><span style=\"color:rgb(255, 0, 0)\"><span style=\"font-size:22px\">CẦN B&Aacute;N NH&Agrave; CH&Iacute;NH CHỦ&nbsp; Li&ecirc;n hệ ch&iacute;nh chủ: 0937 535 448</span></span><br />\r\n<span style=\"font-size:20px\">Gia chủ đang kẹt tiền n&ecirc;n b&aacute;n, nh&agrave; c&oacute; g&aacute;c lửng ph&iacute;a tr&ecirc;n, c&oacute; chỗ đậu &ocirc; t&ocirc; 7 chỗ.<br />\r\nNằm trong vị tr&iacute; đắc địa tr&ecirc;n đường Lưu Hữu Phước, mặt tiền đường hướng ra K&ecirc;nh đ&ocirc;i. C&aacute;ch Đại lộ V&otilde; Văn Kiệt 5 ph&uacute;t, bến Ph&uacute; Định 10 ph&uacute;t, bến xe Quận 8 - 15 ph&uacute;t di chuyển bằng xe m&aacute;y.<br />\r\nD&acirc;n cư đ&ocirc;ng đ&uacute;c, kh&ocirc;ng gian tho&aacute;ng m&aacute;t cả ng&agrave;y do ở cạnh nh&aacute;nh s&ocirc;ng, đường lớn, xe &ocirc; t&ocirc; đậu thoải m&aacute;i, gần C&ocirc;ng An phường 15, Q8 anh ninh khu vực rất tốt.<br />\r\nC&aacute;c tiện &iacute;ch xung quanh đầy đủ: gần trường học c&aacute;c cấp, c&aacute;c cơ quan chức năng, chợ, cơ sở y tế, bệnh viện, si&ecirc;u thị, c&ocirc;ng vi&ecirc;n, khu vui chơi giải tr&iacute;, ...<br />\r\nGiao th&ocirc;ng đi lại thuận tiện, sạch, đẹp.<br />\r\nĐịa chỉ:&nbsp;<span style=\"color:rgb(178, 34, 34)\">đường Lưu Hữu Phước -&nbsp; phường 15 &ndash; quận 8 &ndash; th&agrave;nh phố Hồ Ch&iacute; Minh</span><br />\r\nDiện t&iacute;ch:&nbsp;<span style=\"color:rgb(178, 34, 34)\">105m2</span>&nbsp;(ngang 5 x d&agrave;i 21)<br />\r\nSổ hồng ri&ecirc;ng, giấy tờ ph&aacute;p l&yacute; r&otilde; r&agrave;ng.<br />\r\nGi&aacute; b&aacute;n:&nbsp;<span style=\"color:rgb(178, 34, 34)\">7,2 tỷ&nbsp;</span>&nbsp;( c&oacute; thương lượng nhẹ )<br />\r\nNhanh tay li&ecirc;n hệ:&nbsp;<span style=\"color:rgb(178, 34, 34)\">0937 535 448</span>&nbsp;gặp Tuấn Thanh hoặc Zalo:&nbsp;<span style=\"color:rgb(178, 34, 34)\">0937 535 448</span>&nbsp;để&nbsp; ( trao đổi chi tiết ).</span></p>\r\n',	'7,2 tỷ',	'',	'105m2',	'