(305,	785318,	'2,85 tỉ... Đê La Thành, Hà Nội.. Nở hậu rất đẹp',	'Nhà xây trên diện tích 32m2 tầng 2 đua ra 35m2 Trước',	'<p><span style=\"color:rgb(28, 30, 33); font-family:helvetica,arial,sans-serif; font-size:12px\">Nh&agrave; x&acirc;y tr&ecirc;n diện t&iacute;ch 32m2 tầng 2 đua ra 35m2 Trước cửa nh&agrave; c&oacute; s&acirc;n rất rộng chung 5 6 hộ sử dụng, tho&aacute;ng m&aacute;t, để được nhiều xe. Ng&otilde; trước nh&agrave; rộng hơn 2m, c&aacute;ch đường &ocirc; t&ocirc; khoảng 50m. Nh&agrave; thiết kế hiện đại, mỗi tầng một ph&ograve;ng v&agrave; nh&agrave; vệ sinh. Tầng 1: ph&ograve;ng kh&aacute;ch, bếp Tầng 2: 2 ph&ograve;ng ngủ v&agrave; 1wc Tầng 3: 2 ph&ograve;ng ngủ v&agrave; 1wc Tầng 4: 1 ph&ograve;ng thờ v&agrave; 1 s&acirc;n phơi Chủ nh&agrave; ở giữ g&igrave;n, sạch sẽ. Kh&aacute;ch về ở lu&ocirc;n. Khu vực d&acirc;n tr&iacute; cao, h&agrave;ng x&oacute;m vui vẻ th&acirc;n thiện </span></p>\r\n\r\n<div>&nbsp;</div>\r\n',	'2.85 tỷ',	'',	'35',	'35',	'Đống Đa - Hà Nội',	'',	'',	'',	'75521602_2189784614456059_5397204853619425280_n.jpg',	'',	0,	0,	1,	0,	0,	0,	83,	'',	'',	'2019-11-12',	1,	'',	'',	'',	0,	0,	'0000-00-00',	'2',	'32',	'',	'0',	'Hà Nội',	'Đống Đa',	'',	NULL,	'',	0,	1,	1,	'',	'',	'',	'',	'',	'',	1,	0),
