(326,	398876,	'Cần thuê nhà làm siêu thị tiện lợi 7-eleven.',	'Cần thuê nhà làm siêu thị tiện lợi 7-eleven.<br />\r\n',	'<p>Cần thu&ecirc; nh&agrave; l&agrave;m si&ecirc;u thị tiện lợi 7-eleven.<br />\r\n7-Eleven hiện c&oacute; 38.000 cửa h&agrave;ng ngo&agrave;i Nhật Bản, trong đ&oacute; c&oacute; c&aacute;c quốc gia Đ&ocirc;ng Nam &Aacute; như Th&aacute;i Lan, Malaysia, Philippines, Singapore v&agrave; Indonesia. Việt Nam l&agrave; thị trường thứ 19.<br />\r\nĐơn vị ch&uacute;ng t&ocirc;i hiện đang giới thiệu mặt bằng cho si&ecirc;u thị 7-eleven cần thu&ecirc; nh&agrave; ở c&aacute;c tất cả c&aacute;c quận trung t&acirc;m TP. HCM với c&aacute;c y&ecirc;u cầu như sau:<br />\r\nDiện t&iacute;ch cần thu&ecirc;:</p>\r\n\r\n<ul>\r\n	<li>Bề ngang tối thiểu l&agrave; 6m (ph&ugrave; hợp nhất l&agrave; 8m &ndash; 10m).</li>\r\n	<li>Chiều d&agrave;i tối thiểu l&agrave; 15m (ph&ugrave; hợp nhất l&agrave; tr&ecirc;n 20m).<br />\r\n	Vị tr&iacute; cần thu&ecirc;:</li>\r\n	<li>Nh&agrave; nằm ở c&aacute;c khu đ&ocirc;ng d&acirc;n cư, đ&ocirc;ng người qua lại.</li>\r\n	<li>Ưu ti&ecirc;n c&aacute;c vị tr&iacute; gần chợ, trường cấp 3, khu phố T&acirc;y</li>\r\n	<li>Trục đường du lịch, khu vực văn ph&ograve;ng, Trường đại học, c&oacute; nhiều ng&acirc;n h&agrave;ng, chung cư</li>\r\n	<li>Nếu khu vực đ&atilde; c&oacute; c&aacute;c thương hiệu 24h kh&aacute;c: Circle K, Familymart,&hellip; th&igrave; vị tr&iacute; phải đẹp hơn, mặt tiền lớn hơn,&hellip;<br />\r\n	Gi&aacute; thu&ecirc;:</li>\r\n	<li>&Aacute;p dụng với diện t&iacute;ch nhỏ gi&aacute; dưới: 40 triệu/th&aacute;ng.</li>\r\n	<li>&Aacute;p dụng với diện t&iacute;ch lớn gi&aacute; dưới: 90 triệu/th&aacute;ng.</li>\r\n	<li>Đối với c&aacute;c vị tr&iacute; căn g&oacute;c 2, 3 mặt tiền ch&uacute;ng t&ocirc;i c&oacute; thể thu&ecirc; với gi&aacute; tr&ecirc;n 120 triệu.</li>\r\n</ul>\r\n\r\n<p>Qu&yacute; chủ nh&agrave; c&oacute; vị tr&iacute; cho thu&ecirc; th&iacute;ch hợp vui l&ograve;ng liện hệ với ch&uacute;ng t&ocirc;i qua:<