g, Hưng Y&ecirc;n, Th&aacute;i B&igrave;nh, Nam Định, Ninh B&igrave;nh</p>\r\n</blockquote>\r\n\r\n<blockquote>\r\n<p><strong>Zone 3</strong>&nbsp;gồm: Thanh Ho&aacute;, Nghệ An, H&agrave; Tĩnh, Quảng B&igrave;nh, Quảng Trị, Thừa Thi&ecirc;n Huế, Quảng Nam, Quảng Ng&atilde;i, B&igrave;nh Định, Ph&uacute; Y&ecirc;n</p>\r\n</blockquote>\r\n\r\n<blockquote>\r\n<p><strong>Zone 4</strong>&nbsp;gồm: Kh&aacute;nh Ho&agrave;, Ninh Thuận, B&igrave;nh Thuận, Kon Tum, Gia Lai, Đắk Lắk, Đắk N&ocirc;ng, L&acirc;m Đồng, B&igrave;nh Phước</p>\r\n</blockquote>\r\n\r\n<blockquote>\r\n<p><strong>Zone 5 gồm:</strong>&nbsp;T&acirc;y Ninh, Đồng Nai, B&agrave; Rịa - Vũng T&agrave;u, Long An</p>\r\n</blockquote>\r\n\r\n<blockquote>\r\n<p><strong>Zone 6</strong>&nbsp;gồm: Tiền Giang, Bến Tre, Tr&agrave; Vinh, Vĩnh Long, Đồng Th&aacute;p, An Giang, Ki&ecirc;n Giang, Cần Thơ, Hậu Giang, S&oacute;c Trăng, Bạc Li&ecirc;u, C&agrave; Mau</p>\r\n</blockquote>\r\n\r\n<p>**5 ► NG&Acirc;N S&Aacute;CH CHO PH&Eacute;P THU&Ecirc; MẶT BẰNG VINMAT + **<br />\r\n&Aacute;p dụng với mặt tiền dưới 8m diện t&iacute;ch dưới 120 m2 gi&aacute; dưới: 50 triệu / th&aacute;ng.<br />\r\n&Aacute;p dụng với mặt tiền lơn hơn 12m diện t&iacute;ch LỚN HƠN 160m2 gi&aacute; dưới: 70 triệu / th&aacute;ng<br />\r\n<strong>6 ► LI&Ecirc;N HỆ NGAY VỚI CH&Uacute;NG T&Ocirc;I ĐỂ C&Ugrave;NG HỢP T&Aacute;C CHO VINMART+ THU&Ecirc; MẶT BẰNG:</strong></p>\r\n\r\n<blockquote>\r\n<p><strong>CTY DV PH&Aacute;T TRIỂN MẶT BẰNG B&Aacute;N LẺ VIỆT NAM</strong></p>\r\n\r\n<p><strong>Ph&ograve;ng tiếp nhận mặt bằng</strong><br />\r\n<strong>ĐT: 0938737871</strong></p>\r\n</blockquote>\r\n',	'50tr/ tháng',	'',	'160',	'160',	'Hồ Chí Minh',	'',	'0938737871',	'',	'7bc581298d579c5748448277ac8733941d74ec8b.jpeg',	'',	0,	0,	1,	0,	0,	0,	77,	'',	'',	'2019-12-04',	1,	'http://batdongsanphucthinh.vn/rao-vat/sieu-thi-vinmart-can-thue-mat-bang-cac-tinh-mien-trung-va-khu-vuc-phia-nam-327',	'',	'',	0,	0,	'0000-00-00',	'1',	'0',	'',	'0',	'Hồ Chí Minh',	NULL,	