(333,	198608,	'Nhà xây mới gần cầu Thanh Trì, giáp Cự Khối, Long Biên, ô tô vào nhà, cách Thạch Bàn 1,5km',	'đường 2 oto tránh nhau 8m bán khởi điểm 2 tầng 1 tum hoàn thiện 1.418 triệu',	'<div class=\"detail text-content\" style=\"text-align: justify; padding: 5px; white-space: pre-wrap; color: rgb(0, 0, 0); font-family: Arial, Verdana, sans-serif;\">T&ocirc;i l&agrave; ch&iacute;nh chủ đầu tư, xin miễn trung gian. Đất thổ cư l&acirc;u d&agrave;i, đất ở sử dụng ri&ecirc;ng, sang t&ecirc;n sổ đỏ ngay cho người mua. X&oacute;m 1 Đ&ocirc;ng Dư Thượng, c&aacute;ch cầu Thanh Tr&igrave; 350m, c&aacute;ch đường đ&ocirc;i to Đ&ocirc;ng Dư đi Ecopark 250m. X&acirc;y mới ri&ecirc;ng biệt, kết cấu m&oacute;ng b&egrave; khung cột b&ecirc; t&ocirc;ng cốt th&eacute;p thoải m&aacute;i x&acirc;y l&ecirc;n được ngay 4 5 tầng. ● Căn 30m2 trong ng&otilde; c&aacute;ch đường 2 oto tr&aacute;nh nhau 8m b&aacute;n khởi điểm 2 tầng 1 tum ho&agrave;n thiện 1.418 triệu . X&acirc;y th&ocirc; 1.288 triệu X&acirc;y th&ecirc;m tầng, thay đổi bố tr&iacute; ho&agrave;n thiện theo y&ecirc;u cầu nếu chưa thi c&ocirc;ng đến. ================================================= Thiết kế ban đầu theo b&aacute;o gi&aacute;: Tầng 1: Ph&ograve;ng kh&aacute;ch, 1 bếp c&oacute; sẵn bếp gas &acirc;m v&agrave; tủ bếp b&ecirc;n dưới k&egrave;m chậu rửa, 1 vệ sinh Tầng 2: c&oacute; 2 ph&ograve;ng ngủ k&egrave;m 1 vệ sinh Tầng 3: Tum che cầu thang v&agrave; s&acirc;n phơi Ho&agrave;n thiện to&agrave;n bộ hệ thống điện nước, hệ thống chiếu s&aacute;ng, vệ sinh, tủ bếp b&ecirc;n dưới, bếp ga &acirc;m, bồn rửa, m&aacute;y bơm nước, t&eacute;t nước, cửa ngo&agrave;i cửa trong ================================================== M&ocirc; h&igrave;nh t&ocirc;i l&agrave;m rất c&ocirc;ng khai minh bạch, chỉ ph&ugrave; hợp với người mua để ở với nhu cầu mua nh&agrave; sổ đỏ r&otilde; r&agrave;ng x&acirc;y dựng chắc chắn ki&ecirc;n cố. Nếu bạn muốn mua đất c&oacute; nh&agrave; tạm th&igrave; kh&ocirc;ng ph&ugrave; hợp. T&ocirc;i l&agrave;m m&oacute;ng v&agrave; kết cấu chắc chắn l&ecirc;n 4 - 5 tầng v&igrave; t&ocirc;i b&aacute;n từ khi c&ograve;n đang thi c&ocirc;ng trong đ&oacute; kh&aacute; nhiều người c&oacute; nhu cầu thay đổi bố tr&iacute; v&agrave; th&ecirc;m ngay tầng. Kết bạn zalo c&oacute; video khu tương tự Ho&agrave;n thiện tương tự c&aacute;c khu kh&aacute;c đ&atilde; l&agrave;m c&oacute; ảnh video hoặc anh chị qua xem thực tế nh&agrave; mới b&agrave;n giao. Trực tiếp đầu tư thi c&ocirc;ng x&acirc;y dựng kh&ocirc;ng qua bất cứ trung gian n&agrave;o, nếu kết cấu n&agrave;y chỉ x&acirc;y nh&agrave; 2 3 tầng th&igrave; qu&aacute; chắc chắn. Khuyến kh&iacute;ch dẫn theo người trong ng&agrave;nh x&acirc;y dựng để hiểu r&otilde; hơn. ====================================== Hỗ trợ trả g&oacute;p ng&acirc;n h&agrave;ng 25 năm. Nếu vay tốt nhất n&ecirc;n c&oacute; khoảng 690 triệu để thanh to&aacute;n khi sang t&ecirc;n sổ đỏ v&agrave; giải ng&acirc;n nhanh phần vay. ======================================= Khu vực n&agrave;y t&ocirc;i thi c&ocirc;ng 11 l&ocirc; hiện đ&atilde; b&aacute;n 9 l&ocirc; trong ng&otilde; nhỏ c&ograve;n 2 l&ocirc; ngo&agrave;i đường to n&agrave;y (x&oacute;m 1 Đ&ocirc;ng Dư Thượng) đang thi c&ocirc;ng, khoảng 3 th&aacute;ng nhận nh&agrave; Sang t&ecirc;n sổ đỏ xong để lại khoảng 300 triệu chia nhỏ theo tiến độ x&acirc;y dựng để người mua c&ugrave;ng gi&aacute;m s&aacute;t nghiệm thu theo giai đoạn. 9 l&ocirc; đ&atilde; b&aacute;n cạnh đ&oacute; 100% t&ocirc;i đều b&aacute;n hết trước khi thi c&ocirc;ng tầng 2 (60% b&aacute;n khi c&ograve;n l&agrave; đất) hiện đ&atilde; c&oacute; 6 l&ocirc; về ở, 3l&ocirc; đang x&acirc;y chuẩn bị b&agrave;n giao</div>\r\n\r\n<div class=\"moreinfor\" style=\"padding: 5px; color: rgb(0, 0, 0); font-family: Arial, Verdana, sans-serif;\"><span style=\"font-size:17px\">Gi&aacute;:&nbsp;<strong>1,418 tỷ</strong></span><span style=\"font-size:17px\">Diện t&iacute;ch:&nbsp;<strong>31 m<sup>2</sup></strong></span>\r\n\r\n<div class=\"c