n n&uacute;i Viba,</div>\r\n\r\n<div class=\"detail text-content\" style=\"text-align: justify; padding: 5px; white-space: pre-wrap; color: rgb(0, 0, 0); font-family: Arial, Verdana, sans-serif;\">gần trường mầm non, đi lại trường cấp 1,2, chợ c&ocirc; Giang cũng rất gần. Nh&agrave; rất mới, thiết kế hiện đại gồm 1 trệt 3 lầu,</div>\r\n\r\n<div class=\"detail text-content\" style=\"text-align: justify; padding: 5px; white-space: pre-wrap; color: rgb(0, 0, 0); font-family: Arial, Verdana, sans-serif;\">trang tr&iacute; đẹp mắt, bố tr&iacute; nội thất hợp l&yacute;. Mỗi tầng đều được chủ nh&agrave; thiết kế c&oacute; ban c&ocirc;ng trồng hoa rất l&atilde;ng mạn, c&aacute;c ph&ograve;ng đều đ&oacute;n &aacute;nh s&aacute;ng tự nhi&ecirc;n.</div>\r\n\r\n<div class=\"detail text-content\" style=\"text-align: justify; padding: 5px; white-space: pre-wrap; color: rgb(0, 0, 0); font-family: Arial, Verdana, sans-serif;\">Nh&agrave; nằm trong khu c&aacute;n bộ n&ecirc;n d&acirc;n tr&iacute; rất cao, xung quanh l&agrave; nhiều nh&agrave; mới đẹp. Ng&ocirc;i nh&agrave; l&agrave; lựa chọn ho&agrave;n hảo để an cư, nghỉ dưỡng.</div>\r\n\r\n<div class=\"moreinfor\" style=\"padding: 5px; color: rgb(0, 0, 0); font-family: Arial, Verdana, sans-serif;\">\r\n<p><span style=\"font-size:17px\">Gi&aacute;:&nbsp;<strong>6,2 tỷ</strong></span></p>\r\n\r\n<p><span style=\"font-size:17px\">Diện t&iacute;ch:&nbsp;<strong>69 m<sup>2</sup></strong></span></p>\r\n\r\n<div class=\"clear\" style=\"clear: both;\">&nbsp;</div>\r\n</div>\r\n\r\n<div class=\"address\" style=\"font-size: 15px; padding: 0px 5px; color: rgb(0, 0, 0); font-family: Arial, Verdana, sans-serif;\">Địa chỉ t&agrave;i sản:<strong>&nbsp;Đường L&ecirc; Hồng Phong, Phường 4, Th&agrave;nh phố Vũng T&agrave;u, B&agrave; Rịa Vũng T&agrave;u</strong></div>\r\n',	'6,2 tỷ',	'',	'69 ',	'69 ',	'Đường Lê Hồng Phong, Phường 4, Thành phố Vũng Tàu, Vũng Tàu',	'',	'0933734678',	'',	'337.jpg',	'',	0,	0,	1,	0,	0,	0,	87,	'',	'',	'2019-12-10',	1,	'h