(348,	844786,	'Bán Shophouse LK 1.7 DA Đại Kim – Định Công Mặt Đường 30M – 0943.513.555',	'Diện tích từ 77m2 - 80 m2 - 90m2 - 100m2 - 115m2 - 230m2',	'<p>B&aacute;n Shophouse LK 1.7 DA Đại Kim - Định C&ocirc;ng mặt đường 30M - 0943.513.555<br />\r\nCần b&aacute;n suất ngoại giao Shophouse diện t&iacute;ch: 113m2, gi&aacute; sở hữu hiện tại chỉ 4,5 tỷ/căn , Vị tr&iacute; đẹp gọi ngay để biết vị tr&iacute; cụ thể. Call : 0943.513.555<br />\r\nHiện Ch&uacute;ng t&ocirc;i c&oacute; 01 suất ngoại giao cuối c&ugrave;ng nh&agrave; liền kề shophouse Mặt đường 30m, trục ch&iacute;nh nối 2 Khu Đ&ocirc; Thị Kim Văn Kim Lũ v&agrave; KĐT Định C&ocirc;ng, Đường nối Đường V&agrave;nh Đai 2.5 sang đường v&agrave;nh đai 3, Vị Tr&iacute; đẹp nhất, Chốt &ocirc; chốt số v&agrave;o lu&ocirc;n HĐ trực tiếp với chủ đầu tư gi&aacute; chỉ 50 Triệu/m2 cam kết gi&aacute; kh&ocirc;ng thay đổi cho đến khi nhận SĐ, Đ&atilde; đầy đủ ph&aacute;p l&yacute;:( Giấy CN đầu tư, TL 1:500, hợp đồng BT, ph&ecirc; duyệt kiến tr&uacute;c sơ bộ) cam kết Qu&yacute; IV năm 2020 san lấp xong v&agrave; b&agrave;n giao mốc giới. Nhận sổ đỏ ngay khi x&acirc;y xong nh&agrave;<br />\r\nDự &aacute;n nằm tr&ecirc;n trục của đường v&agrave;nh đai 2,5, ở ngay cửa ng&otilde; giao th&ocirc;ng ph&iacute;a Nam của TP. H&agrave; Nội, gần trục đường Giải Ph&oacute;ng &ndash; Quốc Lộ 1A, gần đường v&agrave;nh đai 3. Ngo&agrave;i ra, dự &aacute;n c&ograve;n gần c&aacute;c địa điểm lớn như: Bệnh viện Bưu Điện, Bệnh Viện Bạch Mai, B&ecirc;nh Viện Tai Mũi Họng Trung Ương, B&ecirc;nh Viện Nhiệt Đới Trung Ương, Bệnh Viện Nội Tiết, Bệnh Viện Đại Học Y H&agrave; Nội, Bến xe Gi&aacute;p B&aacute;t, Bến xe Nước Ngầm; &hellip;<br />\r\nCƠ HỘI ĐẦU TƯ SINH LỜI NHANH TẠI DỰ &Aacute;N KĐT ĐẠI KIM ĐỊNH C&Ocirc;NG<br />\r\nVỊ TR&Iacute; ĐẮC ĐỊA - PH&Aacute;P L&Yacute; ĐẦY ĐỦ - THANH KHOẢN NHANH<br />\r\n✔️ Khu đ&ocirc; thị đồng bộ v&agrave; hiện đại duy nhất VỊ Tr&iacute; V&agrave;ng- Gần S&aacute;t Trung T&acirc;m.<br />\r\n✔️ Hội tụ đầy đủ điều kiện của 1 dự &aacute;n tiềm năng.<br />\r\n✔️ C&aacute;c sản phẩm đất nền sổ đỏ liền kề, biệt thự, nh&agrave; phố.<br />\r\n✔️ Diện t&iacute;ch từ 77m2 - 80 m2 - 90m2 - 100m2 - 115m2 - 230m2<br />\r\nTh&ocirc;ng tin chi tiết về dự &aacute;n:<br />\r\nĐịa điểm: Phường Định C&ocirc;ng v&agrave; Phường Đại Kim, Quận Ho&agrave;ng Mai, TP. H&agrave; Nội.<br />\r\n&bull; Được khởi c&ocirc;ng ng&agrave;y 19/03/2014, hiện đang c&ocirc;ng t&aacute;c san lấp v&agrave; giải ph&oacute;ng mặt bằng. Chủ đầu tư cam kết tiến độ như sau:<br />\r\n&bull; Tổ chức thực hiện c&ocirc;ng t&aacute;c GPMB, bồi thường, hỗ trợ v&agrave; t&aacute;i định cư của dự &aacute;n: Dự kiến bắt đầu qu&yacute; IV/2019.<br />\r\n&bull; Tổ chức triển khai thi c&ocirc;ng hạ tầng kỹ thuật dự &aacute;n: Thực hiện cuốn chiếu theo tiến độ GPMB: Bắt đầu qu&yacute; I/ 2020.<br />\r\n&bull; Hiện đang đền b&ugrave; giải ph&oacute;ng mặt bằng, nhanh ch&acirc;n số lượng liền kề c&oacute; hạn, mua xong l&atilde;i ngay.<br />\r\n&bull; B&agrave;n giao mốc giới &ocirc; đất tr&ecirc;n thực địa: Qu&yacute; IV/2020.<br />\r\n*** Tiến độ đ&oacute;ng tiền:<br />\r\n+ Đợt 1: Đ&oacute;ng 50% ngay khi k&yacute; HĐ.<br />\r\n+ Đợt 2: Đ&oacute;ng 20% khi triển khai c&ocirc;ng t&aacute;c GPMB.<br />\r\n+ Đợt 3: Đ&oacute;ng 20% khi triển khai san lấp MB, triển khai hạ tầng.<br />\r\n+ Đợt 4: Đ&oacute;ng 10% khi nhận mốc giới.<br />\r\nHoăc xem chi tiết tai : daikimdinhcong.net hoặc thongtindautu.info</p>\r\n\r\n<p>B&aacute;n liền kề đại kim đinh c&ocirc;ng mở r&ocirc;ng | b&aacute;n Shophouse đại kim đinh c&ocirc;ng mở r&ocirc;ng | B&aacute;n liền kề đại kim mở r&ocirc;ng | B&aacute;n liền kề đinh c&ocirc;ng mở r&ocirc;ng | Shophouse đại kim đinh c&ocirc;ng | Shophouse đại kim mở r&ocirc;ng | Shophouse đinh c&ocirc;ng mở r&ocirc;ng | B&aacute;n liền kề đại kim đinh c&ocirc;ng | b&aacute;n Shophouse đại kim đinh c&ocirc;ng | B&aacute;n đất đại kim đinh c&ocirc;ng | B&aacute;n nh&agrave; đại kim đinh c&ocirc;ng | B&aacute;n liề