(350,	798583,	'Bán Lô Đất Đường 7m5 Sau Lưng Đường Trần Nguyên Đán 10,5m',	'Pháp lý SỔ ĐỎ có sẵn trao tay.<br />\r\nSở hữu vị trí đắc địa ngay TTTP - Toạ lạc trên trục đường lớn Nguyễn Sinh Sắc',	'<p><span style=\"color:rgb(102, 102, 102); font-family:arial\">Sunshine luxury mang trong m&igrave;nh những tiện &iacute;ch ho&agrave;n hảo, ưu thế bậc nhất hiện nay đảm bảo đ&aacute;p ứng nhu cầu kh&aacute;ch h&agrave;ng h&agrave;i l&ograve;ng đến 100%.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">Ph&aacute;p l&yacute; SỔ ĐỎ c&oacute; sẵn trao tay.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">Sở hữu vị tr&iacute; đắc địa ngay TTTP - Toạ lạc tr&ecirc;n trục đường lớn Nguyễn Sinh Sắc(60m) giao với trục Ho&agrave;ng Thị Loan (42m)</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">Dự &aacute;n hiếm hoi đc bao bọc bởi b&atilde;i biển du lịch si&ecirc;u đẹp si&ecirc;u sang ch&atilde;nh bậc nhất th&agrave;nh phố.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">Xung quanh Sunshine luxury l&agrave; hệ thống gi&aacute;o dục đa dạng từ mầm non đến đại học, c&aacute;c CQHC, bệnh viện, TTTM cao cấp New Vincom.....</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">Với lợi thế hiện hữu sẵn c&oacute; từ vị tr&iacute; ng&agrave;n v&agrave;ng, Sunshine luxury được kỳ vọng sẽ trở th&agrave;nh khu đ&ocirc; thị bậc nhất của khu vực - bảo chứng cho một cuộc sống vi&ecirc;n m&atilde;n, phồn vinh, tiềm năng đầu tư, sinh lời v&ocirc; hạn cho bất kỳ chủ sở hữu.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">LH: 0708.360.381</span></p>\r\n',	'liên hệ',	'',	'107',	'',	'Quận Liên Chiểu, Đà Nẵng',	' Nguyễn Văn Nam',	'0708360381',	'',	'phodothi_com-36961.jpg',	'phodothi_com-37011.jpg#phodothi_com-37021.jpg',	0,	0,	1,	0,	0,	0,	25,	'',	'',	'2019-12-26',	1,	'http://batdongsanphucthinh.vn/rao-vat/ban-lo-dat-duong-7m5-sau-lung-duong-tran-n