(351,	819595,	'Cho Thuê Nhà Riêng Trần Vĩ 4 Tầng Anh /Chị Quan Tâm Gọi Ngay Hôm Nay',	' Đối diện đường Lê Đức Thọ, từ đường Hồ Tùng Mậu rẽ vào',	'<p><span style=\"color:rgb(102, 102, 102); font-family:arial\">1. Em xin gửi tới anh chị th&ocirc;ng tin căn hộ chi tiết như sau:</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&bull; Do đ&atilde; c&oacute; nh&agrave; ri&ecirc;ng kh&aacute;c, chủ nh&agrave; cần cho thu&ecirc; gấp nh&agrave; ri&ecirc;ng tại ng&otilde; 72 Trần Vĩ, gần Trường đại học h&agrave;n quốc quận Bắc Từ Li&ecirc;m, H&agrave; Nội.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&bull; Nh&agrave; 4 gồm tầng x&acirc;y để ở n&ecirc;n rất trang trọng,sạch đẹp, diện t&iacute;ch sổ l&agrave;: 45m2, diện t&iacute;ch thực: 50m2 đ&atilde; c&oacute; đầy đủ c&aacute;c trang thiết bị sử dụng.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&bull; Ng&otilde; ch&iacute;nh &ocirc; t&ocirc; tr&aacute;nh th&ocirc;ng sang Mai Dịch. Hướng nh&agrave; Ch&iacute;nh Đ&ocirc;ng, mặt tiền 5m3</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&bull; Tầng 1: ph&ograve;ng kh&aacute;ch gồm, Bộ b&agrave;n ghế, 1 kệ tủ đựng đồ v&agrave; tivi, 1 bể c&aacute;</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&bull; Bếp: Đ&atilde; đầy đủ thiết bị nấu nướng, tủ bếp, bếp từ Đức, tủ lạnh</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&bull; Tầng 2, Tầng 3 gồm 2 ph&ograve;ng ngủ: C&aacute;c ph&ograve;ng ngủ đ&atilde; c&oacute; đầy đủ giường, tủ quần &aacute;o, b&agrave;n l&agrave;m việc, điều h&ograve;a, thiết bị điện.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&bull; Nh&agrave; vệ sinh c&oacute; đầy đủ thiết bị vệ sinh như : b&igrave;nh n&oacute;ng lạnh, đ&egrave;n sưởi, v&ograve;i sen, ...</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&bull; Tầng 4 gồm 1 Ph&ograve;ng Thờ, 1 Ph&ograve;ng giặt, v&agrave; 1 S&acirc;n phơi khoảng 30m2</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">2. ghi ch&uacute;</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">a) Chủ nh&agrave; đang ở n&ecirc;n v&ocirc; c&ugrave;ng sạch sẽ gọn g&agrave;ng, t&igrave;m được kh&aacute;ch thu&ecirc; sẽ dọn ra lu&ocirc;n</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">b) Cần kh&aacute;ch thu&ecirc; l&agrave;m văn ph&ograve;ng hoặc hộ gia đ&igrave;nh.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">c) Gi&aacute; thu&ecirc; mong muốn 19 triệu/ th&aacute;ng, đặt cọc 1 thanh to&aacute;n 3</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">3. Tiện &iacute;ch khu vực:</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&bull; Đối diện đường L&ecirc; Đức Thọ, từ đường Hồ T&ugrave;ng Mậu rẽ v&agrave;o, đường v&ocirc; c&ugrave;ng rộng, giao th&ocirc;ng thuận tiện.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&bull; Đối diện l&agrave; chung cư Goldmark City tập trung đa số người H&agrave;n Quốc</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&bull; B&ecirc;n cạnh l&agrave; trường học H&agrave;n Quốc H&agrave; Nội, c&acirc;y xăng Trấn Vĩ</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&bull; Hiện tại mặt bằng c&aacute;c t&ograve;a nh&agrave; mặt đường đ&atilde; được thu&ecirc; hết, gi&aacute; trung b&igrave;nh khoảng 20 triệu/ s&agrave;n. Gi&aacute; thu&ecirc; cho căn nh&agrave; n&agrave;y l&agrave; qu&aacute; ưu đ&atilde;i</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&bull; Gần c&aacute;c trường đại học: Đại học Thương Mại, S&acirc;n Khấu Điện Ảnh, Cao Đẳng M&uacute;a</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&bull; C&aacute;ch c&ocirc;ng vi&ecirc;n Mai Dịch khoảng 100m</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&bull; Chủ nh&agrave; rất thiện ch&iacute; cho thu&ecirc; mong muốn gặp được kh&aacute;ch thu&ecirc; l&acirc;u d&agrave;i</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\"> Sau khi đ&atilde; tham khảo c&aacute;c th&ocirc;ng tin anh chị c&oacute; quan t&acirc;m c&oacute; thể li&ecirc;n lạc với em qua số đt: O349723208 để trao đổi cụ thể hơn</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\"> Rất mong nhận được sự quan t&acirc;m của anh/chị</span></p>\r\n',	' 19 triệu/ tháng',	'',	'50',	'50',	'Quận Cầu Giấy, Hà Nội',	' thiennd2101',	'O349723208',	'',	'3511.jpg',	'',	1,	0,	0,	0,	0,	0,	74,	'',	'',	'2019-12-27',	1,	'http://batdongsanphucthinh.vn/rao-vat/cho-thue-nha-rieng-tran-vi-4-tang-anh-chi-quan-tam-goi-ngay-hom-nay-351',	'',	'',	0,	0,	'0000-00-00',	'2',	'28',	'',	'0',	'Hà Nội',	'Cầu Giấy',	'',	NULL,	'',	1,	1,	0,	'',	'',	'',	'',	'',	'',	2,	0),
(352,	71495,	'Cho Thuê Phòng Trọ Đường Trần Điền, Phường Định Công, Quận Hoàng Mai',	'- Khu dân trí cao-Oto đi tận cửa nhà\r\n-Tầng 1 để xe miễn phí ,',	'<p><span style=\"color:rgb(102, 102, 102); font-family:arial\">Ph&ograve;ng đẹp full đồ,c&oacute; ban c&ocirc;ng</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">- Khu d&acirc;n tr&iacute; cao-Oto đi tận cửa nh&agrave;</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">-Tầng 1 để xe miễn ph&iacute; ,</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">- M&aacute;y giặt miễn ph&iacute; cả nh&agrave; d&ugrave;ng chung, d&acirc;y phơi quần &aacute;o tho&aacute;ng ở v&agrave; ban c&ocirc;ng</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">- Nh&agrave; vệ sinh đẹp, rộng r&atilde;i, lịch sự, v&ograve;i hoa sen, n&oacute;ng lạnh, bệt,gương,...1 tầng 2 ph&ograve;ng chung 1 vs.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">- C&oacute; điều h&ograve;a, n&oacute;ng lạnh, giường, tủ, m&aacute;y giặt...</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">- C&oacute; camera an ninh</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">- Internet c&aacute;p quang tốc độ cao</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">- Điện 3,5k/ số</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">- Nước 80k/ người.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">- Tuần c&oacute; người qua dọn vệ sinh chung cả nh&agrave; thường xuy&ecirc;n.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">- Kh&ocirc;ng ở chung chủ. Giờ giấc đi lại thoải m&aacute;i, tiếp bạn b&egrave; v&ocirc; tư miễn l&agrave; lịch sự - Hợp đồng l&acirc;u d&agrave;i kh&ocirc;ng tăng gi&aacute;, chu kỳ đ&oacute;ng tiền nh&agrave; 1 th&aacute;ng 1 lần, đặt cọc 1 th&aacute;ng tiền nh&agrave;</s