(353,	778857,	' bán Nhà tại ngõ 98 Đàm Quang Trung - Làng Nha -  P. Long Biên',	'Nhà hai mặt tiền, đường trước 3,5 m, ngõ cạnh 2m<br />\r\nDiện tích 57,5m2 x 5 tầng',	'<p>Do kh&ocirc;ng c&oacute; nhu cầu sử dụng n&ecirc;n em xin đăng b&aacute;n Nh&agrave; tại ng&otilde; 98 Đ&agrave;m Quang Trung - L&agrave;ng Nha; P. Long Bi&ecirc;n, nằm trong trục ng&otilde; ch&iacute;nh đối diện Đại si&ecirc;u thị Aeon Mall Long bi&ecirc;n, th&ocirc;ng ng&otilde; 206 Cổ linh, &ocirc; t&ocirc; tải v&agrave;o tận cửa.</p>\r\n\r\n<p><span style=\"font-family:inherit\"><span style=\"color:transparent; font-family:inherit; font-size:16px\">✌</span></span>Nh&agrave; hai mặt tiền, đường trước 3,5 m, ng&otilde; cạnh 2m. Diện t&iacute;ch 57,5m2 x 5 tầng mới x&acirc;y 2017. Mặt trước 5,8m hướng Đ&ocirc;ng Bắc, hậu 7,2m.<br />\r\nNh&agrave; thiết kế hiện đại, chuẩn Ch&acirc;u &Acirc;u, rất tho&aacute;ng m&aacute;t, c&aacute;c ph&ograve;ng đều c&oacute; cửa sổ, ban c&ocirc;ng. &Aacute;nh s&aacute;ng chan ho&agrave;, hoa thơm ng&agrave;o ngạt...</p>\r\n',	' 5tỷ2',	'',	'57.5',	'287.5',	'Phường Long Biên, Quận Long Biên, Hà Nội',	'',	'',	'',	'80609516_3411502172225074_416679842814099456_n.jpg',	'80528935_3411501825558442_5689124413404872704_n.jpg#80653333_3411502072225084_1296181942651191296_n.jpg#80793301_3411502315558393_244906869238267904_n.jpg#80898932_3411501978891760_549512796048457728_n.jpg#81266119_3411501908891767_6299783632349298688_o.jpg#81280916_3411502445558380_3793863935338217472_n.jpg#81798144_3411502265558398_5616669543481999360_n.jpg',	0,	0,	1,	0,	0,	0,	76,	'',	'',	'2019-12-28',	1,	'http://batdongsanphucthinh.vn/rao-vat/-ban-nha-tai-ngo-98-dam-quang-trung-lang-nha-p-long-bien-353',	'',	'',	0,	0,	'0000-00-00',	'2',	'39',	'603',	'0',	'Hà Nội',	'Long Biên',	'Long Biên',	NULL,	'',	1,	1,	0,	'',	'',	'',	'',	'',	'',	1,	0),
