(355,	148032,	'Bán Nhanh Trước Tết HXH Nguyễn Kiệm P4 Phú Nhuận Giá 3.9 Tỷ.',	'1 trệt 2 lầu sân thượng gồm 2 phòng ngủ, 3 toa lét, 1 Phòng khách 1 bếp.',	'<p><span style=\"color:rgb(102, 102, 102); font-family:arial\">B&aacute;n nhanh trước tết HXH Nguyễn Kiệm p4 Ph&uacute; Nhuận gi&aacute; 3.9 tỷ.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">B&Aacute;N GẤP NH&Agrave; HẺM XE HƠI, NGUYỄN KIỆM, PHƯỜNG 4, PH&Uacute; NHUẬN, GI&Aacute; CHỈ CHƯA ĐẾN 4 TỶ.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">Nh&agrave; thiết kế hiện đại 1 trệt 2 lầu s&acirc;n thượng gồm 2 ph&ograve;ng ngủ, 3 toa l&eacute;t, 1 Ph&ograve;ng kh&aacute;ch 1 bếp.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">Hẻm sạch sẽ an ninh xe hơi quay đầu thoải m&aacute;i.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">Gi&aacute; y&ecirc;u thương 3.9 tỷ kh&ocirc;ng thương lượng.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">Sổ hồng ch&iacute;nh chủ c&ocirc;ng chứng ngay.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">Li&ecirc;n hệ: 0982798409 mr &Acirc;n.</span></p>\r\n',	'3.9 tỷ',	'',	'28',	'28',	'Đường Nguyễn Kiệm, Phường 4, Quận Phú Nhuận, Hồ Chí Minh',	'mr Ân',	'0982798409 ',	'',	'default.png',	'',	0,	0,	0,	0,	0,	0,	6,	'',	'',	'2019-12-30',	1,	'http://batdongsanphucthinh.vn/rao-vat/ban-nhanh-truoc-tet-hxh-nguyen-kiem-p4-phu-nhuan-gia-3-9-ty--355',	'',	'',	0,	0,	'0000-00-00',	'1',	'9',	'123',	'2989',	'Hồ Chí Minh',	'Phú Nhuận',	'4',	'Nguyễn Kiệm',	'',	1,	1,	0,	'',	'',	'',	'',	'',	'',	1,	0),
(356,	975106,	'Bán Nhà 2 MT Hẻm VIP BÀN CỜ Quận 3, 7 Tầng – 90m2 Doanh Thu Đỉnh 70tr/Tháng.',	' Nhà 2 mặt hẻm, 1 mặt 7m và \r\n1 mặt 10m đã xây trừ hết lộ giới.',	'<p><span style=\"color:rgb(102, 102, 102); font-family:arial\">VIP &hellip; VIP &hellip; VIP &hellip; Quận 3 B&Agrave;N CỜ lại l&ecirc;n s&oacute;ng.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">Gia chủ cần đi định cư sang nhượng lại với gi&aacute; hữu nghị cực y&ecirc;u chỉ: 21 tỷ c&ograve;n thương lượng mạnh cho kh&aacute;ch nhiệt.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">** Biệt thự ngay l&ocirc; g&oacute;c View si&ecirc;u đẹp, chỉ c&aacute;ch 20m l&agrave; ra mặt tiền đường B&agrave;n cờ.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">** Nh&agrave; 2 mặt hẻm, 1 mặt 7m v&agrave; 1 mặt 10m đ&atilde; x&acirc;y trừ hết lộ giới.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">** Gi&aacute; trị nh&agrave; đ&atilde; gần 10 tỷ, vị chi gi&aacute; đất chỉ: 100 triệu /m2.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">** Nh&agrave; được thiết kế 1 trệt, 1 lửng, 4 lầu, s&acirc;n thượng. Tổng DT sử dụng gần 500m2.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">** Gia chủ thiết kế nh&agrave; c&oacute; 2 gara để xe &ocirc; t&ocirc;. L&agrave;m văn ph&ograve;ng, căn hộ dịch vụ tha hồ để xe, kh&ocirc;ng cần kiếm chỗ gửi xe.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">** Hiện đang cho C&ocirc;ng ty du lịch thu&ecirc; nguy&ecirc;n căn 70 triệu / th&aacute;ng, hợp đồng 5 năm, mỗi năm trượt gi&aacute; 15% tiền thu&ecirc; nh&agrave;.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">** Nh&agrave; gồm 3 s&agrave;n v&agrave; s&acirc;n thượng d&agrave;nh cho kinh doanh c&agrave; ph&ecirc;, ngồi c&agrave; ph&ecirc; tr&ecirc;n tầng thượng ngắm th&agrave;nh phố về đ&ecirc;m rất đẹp.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">**** Vui l&ograve;ng gọi Uy&ecirc;n : 077.4696.167 để được tư vấn v&agrave; xem nh&agrave; miễn ph&iacute; ****</span></p>\r\n',	'10 tỷ',	'',	'500',	'500',	'Quận 3, Hồ Chí Minh',	'gọi Uyên',	'0774696167',	'',	'phodothi_com-1533.jpg',	'phodothi_com-1534.jpg',	0,	0,	1,	0,	0,	0,	58,	'',	'',	'2019-12-31',	1,	'http://batdongsanphucthinh.vn/rao-vat/ban-nha-2-mt-hem-vip-ban-co-quan-3-7-tang-90m2-doanh-thu-dinh-70tr-thang--356',	'',	'',	0,	0,	'0000-00-00',	'1',	'15',	'',	'0',	'Hồ Chí Minh',	'Quận 3',	'',	NULL,	'',	1,	1,	0,	'',	'',	'',	'',	'',	'',	1,	0),
(357,	292184,	'Bán Biệt Thự Vinhomes The Harmony – Tư Vấn Mua Và Chọn Biệt Thự Theo Yêu Cầu',	'Diện tích Vinhomes Harmony: \r\n90m2, 120m2, 180m2, 250m2, 350m2, 400m2.',	'<p>Biệt thự Vinhomes The Harmony l&agrave; giai đoạn 2 của dự &aacute;n Vinhomes Riverside do chủ đầu tư VinGroup ph&aacute;t triển. Dự &aacute;n biệt thự Harmony gồm 4 tiểu khu l&agrave; Hướng Dương, Tulip, Phong Lan v&agrave; Nguyệt Quế được thiết kế theo 4 trường ph&aacute;i kiến tr&uacute;c kh&aacute;c nhau.</p>\r\n\r\n<p>Dự &aacute;n Vinhomes Harmony thiết kế gồm nh&agrave; liền kề, nh&agrave; vườn, biệt thự song lập v&agrave; biệt thự đơn lập.</p>\r\n\r\n<p>Diện t&iacute;ch Vinhomes Harmony: 90m2, 120m2, 180m2, 250m2, 350m2, 400m2.<br />\r\nGi&aacute; b&aacute;n: từ 90 triệu/m2 - 200 triệu/m2<br />\r\nGi&aacute; b&aacute;n tại Vinhomes Harmony phụ thuộc v&agrave;o vị tr&iacute; theo ưu điểm của hạ tầng như hồ điều h&ograve;a, đường trục ch&iacute;nh, l&ocirc; g&oacute;c v&agrave; nội thất b&ecirc;n trong.</p>\r\n\r\n<p>Tham khảo gi&aacute; b&aacute;n tại https://jackby.com/ban-biet-thu-vinhomes-the-harmony/</p>\r\n\r\n<p>Li&ecirc;n hệ tư vấn v&agrave; chọn biệt thự theo y&ecirc;u cầu ri&ecirc;ng<br />\r\nAnh Duy - 0932060333</p>\r\n\r\n<p>Ưu điểm Vinhomes The Harmony<br />\r\n- Qui hoạch đồng bộ, hiện đại.<br />\r\n- Đầy đủ tiện &iacute;ch dịch vụ như TTTM, trường học.<br />\r\n- Quản l&yacute; theo ti&ecirc;u chuẩn 5 sao của Vinhomes, an ninh tốt.</p>\r\n',	'90 triệu/m2',	'',	'100',	'200',	'Phường Phúc Lợi, Quận Long Biên, Hà Nội',	'Anh Duy',	'0932060333',	'',	'download.png',	'',	0,	0,	1,	0,	0,	0,	83,	'',	'',	'2019-12-31',	1,	'http://batdongsanphucthinh.vn/rao-vat/ban-biet-thu-vinhomes-the-harmony-tu-van-mua-va-chon-biet-thu-theo-yeu-cau-357',	'',	'',	0,	0,	'0000-00-00',	'2',	'39',	'607',	'0',	'Hà Nội',	'Long Biên',	'Phúc Lợi',	NULL,	'',	0,	1,	1,	'',	'',	'',	'',	'',	'',	1,	0),
(358,	353751,	'[Hot] Sống Như Nghỉ Dưỡng Tại Times Garden Vĩnh Yên',	' Tư vấn QL vận hành: CBRE (Mỹ)<br />\r\nThiết kế kiến trúc: Site Asia (Pháp)',	'<p><span style=\"color:rgb(102, 102, 102); font-family:arial\">《HOT》 KHU Đ&Ocirc; THỊ ĐỒNG BỘ ĐẲNG CẤP SỐ 1 TẠI VĨNH PH&Uacute;C</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&nbsp;Với ti&ecirc;u ch&iacute;, sống để tận hưởng&nbsp; Khu đ&ocirc; thị Times Garden Vĩnh Y&ecirc;n, kh&ocirc;ng chỉ đem đến nơi để ở, m&agrave; c&ograve;n mang đến cho cư d&acirc;n một Tổ Ấm An L&agrave;nh.</span></p>\r\n\r\n<p><span style=\"color:rgb(102, 102, 102); font-family:arial\">Chủ đầu tư cam kết mang đến cho cư d&acirc;n một nơi ở l&yacute; tưởng v&agrave; an to&agrave;n. Với sự đồng bộ v&agrave; đầy đủ tiện &iacute;ch phục vụ cuộc sống.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">Đối t&aacute;c ph&aacute;t triển dự &aacute;n, l&agrave; những C&ocirc;ng ty h&agrave;ng đầu, uy t&iacute;n.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&nbsp;Nh&agrave; thầu x&acirc;y dựng: Hoa Binh Corporation</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&nbsp;Tư vấn QL vận h&agrave;nh: CBRE (Mỹ)</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">Thiết kế kiến tr&uacute;c: Site Asia (Ph&aacute;p)</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&nbsp;Thiết kế nội thất v&agrave; cảnh quan: West Green Deaign ( Canada).</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&nbsp;Nằm ở vị tr&iacute; si&ecirc;u đẹp, với 2 mặt đường lớn l&agrave; Đinh Ti&ecirc;n Ho&agrave;ng v&agrave; L&yacute; Nam Đế, ở giữa 2 khu đ&ocirc; thị được quy hoạch đồng bộ l&agrave; Nam Vĩnh Y&ecirc;n v&agrave; Nam Đầm Vạc. Thuận lợi di chuyển đến thủ đ&ocirc; H&agrave; Nội v&agrave; c&aacute;c tỉnh l&acirc;n cận. Với khoảng xanh v&agrave; View hồ Đầm Vạc cực đẹp.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">Ch&iacute;nh s&aacute;ch b&aacute;n h&agrave;ng si&ecirc;u hot với chiết khấu l&ecirc;n tới 12%, c&ugrave;ng những ch&iacute;nh s&aacute;ch ưu đ&atilde;i khuyến kh&iacute;ch kh&aacute;ch h&agrave;ng t&acirc;n gia sớm l&ecirc;n tới 500 triệu.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&nbsp;Khu đ&ocirc; thị Times Garden Vĩnh Y&ecirc;n mang hơi thở cuộc sống Phồn Vinh, được x&acirc;y dựng dựa tr&ecirc;n sự tận hưởng cuộc sống d&agrave;nh cho cư d&acirc;n.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">&nbsp;C&ograve;n chần trờ g&igrave;, ch&uacute;ng ta h&atilde;y nhanh tay li&ecirc;n hệ với em để sở hữu căn nh&agrave; l&yacute; tưởng d&agrave;nh cho gia đ&igrave;nh m&igrave;nh với ưu đ&atilde;i cực hấp dẫn từ nay đến hết ng&agrave;y 10/01/2020.</span><br />\r\n<span style=\"color:rgb(102, 102, 102); font-family:arial\">Hotline: 0988 277 513</span></p>\r\n',	'LH',	'',	'330',	'330',	'Vĩnh Phúc',	'Hotline',	'0988277513',	'',	'phodothi_com-5714.jpg',	'phodothi_com-8097.jpg',	0,	0,	1,	0,	0,	0,	1,	'',	'',	'2019-12-31',	1,	'http://batdongsanphucthinh.vn/rao-vat/-hot-song-nhu-nghi-duong-tai-times-garden-vinh-yen-358',	'',	'',	0,	0,	'0000-00-00',	'31',	'0',	'',	'0',	'Vĩnh Phúc',	NULL,	'',	NULL,	'',	1,	1,	0,	'',	'',	'',	'',	'',	'',	1,	0);
