INSERT INTO `contact` (`id`, `company`, `phone`, `address`, `zalo`, `email`, `policy`, `privacy`, `slogan`, `slogan_en`) VALUES
(1,	'Công ty TNHH Thương Mại và Dịch Vụ Tân Bình',	'0796 43 22 11',	'Số 44, Tổ 43,  Phường Trung Tự, Đống Đa, Thành Phố Hà Nội',	'02422658686',	'hotro@batdongsanphucthinh.vn | cskh@batdongsanphucthinh.vn',	'<p><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:14px\"><strong>1.&nbsp;Mục đ&iacute;ch v&agrave; phạm vi thu thập th&ocirc;ng tin</strong></span></span></p>\r\n\r\n<ol>\r\n	<li><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:14px\">&nbsp;Với đặc t&iacute;nh của thị trường bất động sản rất phong ph&uacute;, đa dạng, ch&uacute;ng t&ocirc;i lu&ocirc;n cố gắng giữ cho những th&ocirc;ng tin được đăng tr&ecirc;n trang <a href=\"http://batdongsanphucthinh.vn/\">http://batdongsanphucthinh.vn</a>&nbsp;hữu &iacute;ch v&agrave; ch&iacute;nh x&aacute;c nhất c&oacute; thể. Để thực hiện điều đ&oacute;, <a href=\"http://batdongsanphucthinh.vn/\">http://batdongsanphucthinh.vn</a> y&ecirc;u cầu kh&aacute;ch h&agrave;ng phải cung cấp th&ocirc;ng tin c&aacute; nh&acirc;n trong phạm vi bắt buộc.</span></span></li>\r\n	<li><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:14px\">C&aacute;c th&ocirc;ng tin c&aacute; nh&acirc;n m&agrave; <a href=\"http://batdongsanphucthinh.vn/\">http://batdongsanphucthinh.vn</a> c&oacute; thể thu thập từ Kh&aacute;ch h&agrave;ng: họ t&ecirc;n, giới t&iacute;nh, ng&agrave;y sinh, email, địa chỉ, điện thoại, nghề nghiệp, nơi l&agrave;m việc...</span></span></li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:14px\"><strong>2.Phạm vi sử dụng th&ocirc;ng tin</strong></span></span><br />\r\n&nbsp;</p>\r\n\r\n<ol>\r\n	<li><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:14px\">C&aacute;c th&ocirc;ng tin c&aacute; nh&acirc;n được kh&aacute;ch h&agrave;ng cung cấp c&oacute; thể d&ugrave;ng v&agrave;o c&aacute;c mục đ&iacute;ch sau:</span></span></li>\r\n</ol>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:14px\">- Cung cấp h&agrave;ng h&oacute;a, dịch vụ hay thực hiện những giao dịch m&agrave; Kh&aacute;ch h&agrave;ng y&ecirc;u cầu;</span></span></p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:14px\">- Gửi th&ocirc;ng tin đến Kh&aacute;ch h&agrave;ng;</span></span></p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:14px\">- Ph&acirc;n t&iacute;ch, đ&aacute;nh gi&aacute; v&agrave; ho&agrave;n thiện sản phẩm, dịch vụ (kể cả website), c&ocirc;ng nghệ, quy tr&igrave;nh;</span></span></p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:14px\">- N&acirc;ng cao mối tương t&aacute;c v&agrave; li&ecirc;n kết với Kh&aacute;ch h&agrave;ng;</span></span></p>\r\n\r\n<ol>\r\n	<li><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:14px\">Nếu kh&ocirc;ng c&oacute; sự đồng &yacute; của Kh&aacute;ch h&agrave;ng, <a href=\"http://batdongsanphucthinh.vn/\">http://batdongsanphucthinh.vn</a> sẽ kh&ocirc;ng cung cấp dữ liệu cho b&ecirc;n thứ ba để họ d&ugrave;ng v&agrave;o mục đ&iacute;ch quảng c&aacute;o.</span></span></li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:14px\"><strong>3.&nbsp;Thời gian lưu trữ th&ocirc;ng tin</strong></span></span><br />\r\n&nbsp;</p>\r\n\r\n<ol>\r\n	<li><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:14px\">C&aacute;c th&ocirc;ng tin c&aacute; nh&acirc;n của Kh&aacute;ch h&agrave;ng được lữu trữ trong một thời gian cần thiết, nhằm phục vụ cho c&aacute;c y&ecirc;u cầu kh&aacute;ch h&agrave;ng đưa ra.</span></span></li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:14px\"><strong>4.&nbsp;Địa chỉ của đơn vị thu thập v&agrave; quản l&yacute; th&ocirc;ng tin c&aacute; nh&acirc;n</strong></span></span><br />\r\n&nbsp;</p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:14px\">C&ocirc;ng ty TNHH Thương Mại Dịch Vụ T&acirc;n B&igrave;nh</span></span></p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:14px\">Địa chỉ: Số 44, Tổ 43, Phường Trung Tự, Đống Đa, Th&agrave;nh Phố H&agrave; Nội</span></span></p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:14px\">Tel: 0796 43 22 11&nbsp; &nbsp; &nbsp; Email:&nbsp;<a href=\"mailto:Contact@batdongsan.com.vn\">hotro@</a><a href=\"http://batdongsanphucthinh.vn/\">http://batdongsanphucthinh.vn</a></span></span></p>\r\n\r\n<p><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:14px\"><strong>5.&nbsp;Phương tiện v&agrave; c&ocirc;ng cụ để người d&ugrave;ng tiếp cận v&agrave; chỉnh sửa dữ liệu c&aacute; nh&acirc;n của m&igrave;nh</strong></span></span></p>\r\n\r\n<ol>\r\n	<li><span style=\"font-family:Tahoma,Geneva,sans-serif\"><span style=\"font-size:14px\">C&aacute;c th&agrave;nh vi&ecirc;n được cấp một t&agrave;i khoản bao gồm user v&agrave; password để truy cập <a href=\"http://batdongsanphucthinh.vn/\">http://batdongsanphucthinh.vn</a>. Sau khi đăng nhập, th&agrave;nh vi&ecirc;n c&oacute; quyền sử dụng mọi dịch vụ/ tiện &iacute;ch được cung cấp tr&ecirc;n website theo đ&uacute;ng chức năng, quyền hạn được ph&acirc;n cấp.</span></span></li>\r\n</ol>\r\n',	'<ol>\r\n	<li><span style=\"font-size:14px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">Ch&uacute;ng t&ocirc;i cam kết sẽ bảo mật c&aacute;c Th&ocirc;ng tin c&aacute; nh&acirc;n của Kh&aacute;ch h&agrave;ng, sẽ nỗ lực hết sức v&agrave; sử dụng c&aacute;c biện ph&aacute;p th&iacute;ch hợp để c&aacute;c th&ocirc;ng tin m&agrave; Kh&aacute;ch h&agrave;ng cung cấp cho ch&uacute;ng t&ocirc;i trong qu&aacute; tr&igrave;nh sử dụng website <a href=\"http://batdongsanphucthinh.vn/\">http://batdongsanphucthinh.vn</a>&nbsp;được bảo mật.</span></span></li>\r\n	<li><span style=\"font-size:14px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">Kh&aacute;ch h&agrave;ng cần cung cấp th&ocirc;ng tin c&aacute; nh&acirc;n trong c&aacute;c t&igrave;nh huống sau:</span></span></li>\r\n</ol>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">- Truy cập, sử dụng website;</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">- Y&ecirc;u cầu b&aacute;o gi&aacute;, cung cấp th&ocirc;ng tin, dịch vụ hoặc hỗ trợ;</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">- Đặt mua v&agrave; sử dụng dịch vụ của website;</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">- Tham gia khảo s&aacute;t &yacute; kiến, dự thi c&oacute; thưởng, hoặc c&aacute;c hoạt động khuyến mại, quảng b&aacute; kh&aacute;c;</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">- Đăng k&yacute; nhận tin thư, email quảng c&aacute;o hoặc c&aacute;c loại tin tức kh&aacute;c;</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">- Đăng k&yacute; tham dự tuyển dụng, gửi hồ sơ, l&yacute; lịch;</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">- Đơn vị tổ chức thu thập v&agrave; sử dụng th&ocirc;ng tin c&aacute; nh&acirc;n của Kh&aacute;ch h&agrave;ng tr&ecirc;n website chỉ sau khi Kh&aacute;ch h&agrave;ng đ&atilde; đăng k&yacute; t&agrave;i khoản, tức đ&atilde; được sự đồng &yacute; trước của Kh&aacute;ch h&agrave;ng.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:Tahoma,Geneva,sans-serif\">Quy định về Ch&iacute;nh s&aacute;ch bảo mật th&ocirc;ng tin của <a href=\"http://batdongsanphucthinh.vn/\">http://batdongsanphucthinh.vn</a> ch&iacute;nh thức c&oacute; hiệu lực thi h&agrave;nh kể từ ng&agrave;y14/11/2015.</span></span></p>\r\n',	'Bất động sản phúc thịnh - Đơn giản hóa việc bán hàng - Vì chúng tôi luôn bên bạn !',	'Phuc Thinh Land - Simplify sales - Because we\'re always with you!');
