INSERT INTO `news` (`id`, `name`, `title`, `intro`, `content`, `img`, `highlight`, `document_title`, `meta_description`, `meta_keywords`, `canonical_url`, `robots_meta`, `created_at`, `created_by`, `province_id`) VALUES
(18,	'Bán đất dự án HimLam Hồng Bàng Hải Phòng',	'',	'Bán đất dự án HimLam Hồng Bàng Hải Phòng',	'<div class=\"brief_news_page\" style=\"box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-weight: 600; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">\r\n<p>Khu đất hơn 126.000 m2 chia hơn 720 l&ocirc; bao gồm dải vườn hoa v&agrave; khu phức hợp, trường học, chia l&ocirc; vỉa h&egrave; 3m đường 10 tới 12m.</p>\r\n</div>\r\n\r\n<div class=\"content_news_page\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">\r\n<p>Khu đất chia thửa 48 - 65m2 đường rộng 10-12m c&oacute; vỉa h&egrave;, c&oacute; những l&ocirc; đất 2 mặt đường v&agrave; nhiều l&ocirc; g&oacute;c. Dự &aacute;n nằm tr&ecirc;n đường nối Quốc l&ocirc; 5 cũ v&agrave; quốc lộ 5 mới rộng 35m</p>\r\n\r\n<ul>\r\n	<li>Trong khu c&oacute; khu vườn hoa</li>\r\n	<li>Khu Shophouse vỉa h&egrave; 10m</li>\r\n	<li>C&oacute; trường học</li>\r\n	<li>Được 2 ng&acirc;n h&agrave;ng Sacombank v&agrave; Li&ecirc;n Việt Bank t&agrave;i trợ hỗ trợ vay vốn từ 60-70%</li>\r\n	<li>Dự &aacute;n cấp b&igrave;a đỏ</li>\r\n	<li>C&aacute;ch ng&atilde; 3 Sở Dầu 1km</li>\r\n</ul>\r\n</div>\r\n',	'hp1.jpg',	1,	'Bán đất dự án HimLam Hồng Bàng Hải Phòng',	'',	'',	'',	'',	'2019-07-30 04:12:24',	1,	7),
(19,	'Tại sao nên mua nhà qua chuyên gia môi giới BĐS?',	'',	'Tại sao nên mua nhà qua chuyên gia môi giới BĐS?',	'<h2><span style=\"color:rgb(29, 33, 41); font-family:helvetica,arial,sans-serif; font-size:14px\">Bạn vẫn c&oacute; thể mua nh&agrave;&nbsp;VỚI GI&Aacute; ĐẤT</span><span style=\"color:rgb(29, 33, 41); font-family:helvetica,arial,sans-serif; font-size:14px\">, ngay cả khi bạn đ&agrave;m ph&aacute;n trực tiếp với chủ nh&agrave;.</span><br />\r\n<span style=\"color:rgb(29, 33, 41); font-family:helvetica,arial,sans-serif; font-size:14px\">✥ Ai mua nh&agrave; đất đều muốn mua gi&aacute; rẻ.</span><br />\r\n<span style=\"color:rgb(29, 33, 41); font-family:helvetica,arial,sans-serif; font-size:14px\">✥ Ai cũng muốn tự m&igrave;nh t&igrave;m hiểu về Bất động sản v&igrave; đ&oacute; l&agrave; ng&ocirc;i nh&agrave; m&igrave;nh sẽ ở.</span><br />\r\n<span style=\"color:rgb(29, 33, 41); font-family:helvetica,arial,sans-serif; font-size:14px\">✥ Ai cũng muốn trực tiếp gặp mặt chủ nh&agrave;, chủ đất để đ&agrave;m ph&aacute;n giao dịch, đơn giản l&agrave; bạn chỉ tin c&oacute; m&igrave;nh bạn v&agrave; lo lắng khi m&igrave;nh kh&ocirc;ng l&agrave;m việc đ&oacute; trực tiếp.</span><br />\r\n<span style=\"color:rgb(29, 33, 41); font-family:helvetica,arial,sans-serif; font-size:14px\">TUY NHI&Ecirc;N:</span><br />\r\n<span style=\"color:rgb(29, 33, 41); font-family:helvetica,arial,sans-serif; font-size:14px\">✦ Nếu chỉ đơn thuần muốn mua rẻ kh&ocirc;ng c&oacute; nghĩa bạn sẽ mua được với gi&aacute; rẻ.<br />\r\n✦ Khi mua nh&agrave; bạn kh&ocirc;ng được trang bị những kiến thức về Bất động sản, Phong thủy, X&acirc;y dựng.<br />\r\n✦ Bạn muốn mặc cả trực tiếp, thậm ch&iacute; bạn lu&ocirc;n muốn bớt số tiền nhiều. Đ&ocirc;i l&uacute;c cho d&ugrave; bạn đạt được điều đ&oacute; v&agrave; cảm thấy rất&nbsp;HẢ H&Ecirc;</span><span style=\"font-family:helvetica,arial,sans-serif; font-size:14px\">&nbsp;nhưng bạn vẫn bị mua đắt, đơn giản l&agrave; bạn kh&ocirc;ng biết c&aacute;ch định gi&aacute; 1 căn nh&agrave; hay 1 mảnh đất m&agrave; chỉ đơn thuần đ&agrave;m ph&aacute;n theo kiểu BỚT kh&ocirc;ng c&oacute; l&yacute; do th&iacute;ch đ&aacute;ng.<br />\r\n✦ Đ&ocirc;i l&uacute;c một căn nh&agrave; hay mảnh đất, do chủ đang cần tiền muốn b&aacute;n hoặc thậm ch&iacute; họ cũng như bạn, đưa vội ra một c&aacute;i gi&aacute; qu&aacute; hời nhưng bạn kh&ocirc;ng cảm nhận được điều đ&oacute; m&agrave; chỉ theo qu&aacute;n t&iacute;nh lại&nbsp;Đ&Ograve;I BỚT&nbsp;V&agrave; thế c&oacute; nghĩa l&agrave; bạn sẽ c&oacute; thể kh&ocirc;ng bao giờ mua được căn nh&agrave; đ&oacute; với c&aacute;i gi&aacute; vốn đ&atilde;&nbsp;QU&Aacute; HỢP L&Yacute;&nbsp;rồi.</span></h2>\r\n',	'ny.jpg',	1,	'Tại sao nên mua nhà qua chuyên gia môi giới BĐS?',	'',	'',	'',	'',	'2019-07-30 04:13:29',	1,	7),
(20,	'Bất động sản Hải Phòng phân phối các dự án trọng điểm tại Hải Phòng',	'',	'Bất động sản Hải Phòng phân phối các dự án trọng điểm tại Hải Phòng\r\n',	'<div class=\"brief_news_page\" style=\"box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-weight: 600; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">\r\n<p>Với sứ mệnh &quot;Kết nối những ước mơ &ndash; Hiện thực h&oacute;a những dự định&quot;,&nbsp;c&ocirc;ng ty Bất động sản Hải Ph&ograve;ng&nbsp;lu&ocirc;n nỗ lực hết m&igrave;nh để mang lại cho qu&yacute; kh&aacute;ch h&agrave;ng v&agrave; cộng đồng c&aacute;c dịch vụ bất động sản chuy&ecirc;n nghiệp v&agrave; hiệu quả nhất.</p>\r\n</div>\r\n\r\n<div class=\"content_news_page\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">\r\n<p style=\"text-align:justify\">Tự h&agrave;o l&agrave; đơn vị c&oacute; đội ngũ nh&acirc;n vi&ecirc;n trẻ trung, năng động, nhiệt huyết, ch&uacute;ng t&ocirc;i đ&atilde; v&agrave; đang dần khẳng định vị tr&iacute; đứng đầu trong ng&agrave;nh dịch vụ&nbsp;bất động sản tại Hải Ph&ograve;ng.</p>\r\n</div>\r\n',	'la.jpg',	1,	'Bất động sản Hải Phòng phân phối các dự án trọng điểm tại Hải Phòng',	'',	'',	'',	'',	'2019-07-30 04:14:14',	1,	7),
(21,	'Tòa nhà cao nhất Hải Phòng sắp được xây dựng',	'',	'Tòa nhà cao nhất Hải Phòng sắp được xây dựng\r\n',	'<h2 style=\"text-align:justify\">Vinhomes Riverside Hai Phong niềm tự h&agrave;o mới của đất Cảng</h2>\r\n\r\n<p style=\"text-align:justify\"><a href=\"http://dothihaiphong.vn/thong-tin-du-an-hai-phong\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; background-color: transparent; color: rgb(51, 51, 51); text-decoration-line: none; transition: all 0.3s ease 0s;\">Dự &aacute;n Vinhomes Riverside Hải Ph&ograve;ng</a>&nbsp;c&oacute; tổng diện t&iacute;ch 78.5 hecta, bao gồm tổ hợp cao ốc &ndash; văn ph&ograve;ng &ndash; biệt thự &ndash; liền kề &ndash; nh&agrave; ở cao tầng đ&atilde; được khởi c&ocirc;ng v&agrave;o ng&agrave;y 4/3/2016 với sự tham dự của h&agrave;ng ngh&igrave;n quan kh&aacute;ch đến từ c&aacute;c cấp trung ương, giới đầu tư v&agrave; kh&aacute;ch h&agrave;ng th&acirc;n thiết của Vingroup. Theo nguồn tin đ&aacute;ng tin cậy,&nbsp;<a href=\"http://dothihaiphong.vn/thong-tin-du-an-hai-phong/toa-nha-cao-nhat-hai-phong-sap-duoc-xay-dung-n87.htm\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; background-color: transparent; color: rgb(51, 51, 51); text-decoration-line: none; transition: all 0.3s ease 0s;\">t&ograve;a nh&agrave; cao ốc Vinhomes Hải Ph&ograve;ng</a>&nbsp;sẽ c&oacute; chiều cao 45 tầng &ndash; t&ograve;a nh&agrave; cao nhất Hải Ph&ograve;ng v&agrave; miền Duy&ecirc;n Hải.</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"Phối cảnh Vinhomes Riverside Hải Phòng\" src=\"http://batdongsanhaiphong.net/images/Upload/images/phoi-canh-vinhomes-riverside-hai-phong4.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:450px; margin:0px auto; max-width:100%; padding:0px; vertical-align:middle; width:600px\" title=\"Phối cảnh Vinhomes Riverside Hải Phòng\" /></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11px\">Phối cảnh Vinhomes Riverside Hải Ph&ograve;ng</span></p>\r\n\r\n<p style=\"text-align:justify\">T&ograve;a nh&agrave; dự kiến sẽ bao gồm tổ hợp kh&aacute;ch sạn &ndash; văn ph&ograve;ng &ndash; trung t&acirc;m thương mại đ&aacute;p ứng ti&ecirc;u chuẩn 5 sao, đẳng cấp quốc tế. T&ograve;a nh&agrave; hứa hẹn sẽ đem tới diện mạo mới của th&agrave;nh phố cảng, l&agrave; niềm tự h&agrave;o mới của cư d&acirc;n tương lai v&agrave; của người d&acirc;n đất Cảng.</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"Vị trí tòa nhà Vinhomes Riverside Hải Phòng\" src=\"http://batdongsanhaiphong.net/images/Upload/images/phoi-canh-vinhomes-riverside-hai-phong.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:295px; margin:0px auto; max-width:100%; padding:0px; vertical-align:middle; width:600px\" title=\"Vị trí tòa nhà Vinhomes Riverside Hải Phòng\" /></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11px\">Vị tr&iacute; t&ograve;a nh&agrave; Vinhomes Hải Ph&ograve;ng 45 tầng</span></p>\r\n\r\n<p style=\"text-align:justify\">T&ograve;a nh&agrave; cao nhất Hải Ph&ograve;ng sẽ tọa lạc tại vị tr&iacute; đắc địa hiếm c&oacute; với 3 tầm view tuyệt đẹp nh&igrave;n ra s&ocirc;ng Cửa Cấm, s&ocirc;ng Thượng L&yacute; v&agrave; tiếp gi&aacute;p c&aacute;c tuyến đường giao th&ocirc;ng huyết mạch đường 5 (đi H&agrave; Nội) v&agrave; nam cầu B&iacute;nh. Đ&acirc;y sẽ l&agrave; t&ograve;a nh&agrave; cao nhất miền Duy&ecirc;n Hải hiện nay v&agrave; được kỳ vọng sẽ l&agrave; trung t&acirc;m du lịch, mua sắm v&agrave; vui chơi giải tr&iacute; nổi bật của th&agrave;nh phố.</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"Tiện ích Vinhomes Riverside Hải Phòng\" src=\"http://batdongsanhaiphong.net/images/Upload/images/vincom-riverside-hai-phong.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:383px; margin:0px auto; max-width:100%; padding:0px; vertical-align:middle; width:600px\" title=\"Tiện ích Vinhomes Riverside Hải Phòng\" /></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11px\">Tiện &iacute;ch Vinhomes Riverside Hải Ph&ograve;ng</span></p>\r\n\r\n<p style=\"text-align:justify\">Dự &aacute;n được x&acirc;y dựng tr&ecirc;n nền đất của nh&agrave; m&aacute;y Xi Măng Hải Ph&ograve;ng cũ với số vốn khổng lồ. Nơi đ&acirc;y đ&atilde; chứng kiến quốc tr&igrave;nh h&igrave;nh th&agrave;nh v&agrave; ph&aacute;t triển của th&agrave;nh phố Cảng suốt 117 năm qua, bao thăng trầm, bao biến cố của người Hải Ph&ograve;ng đều gắn liền b&ecirc;n mảnh đất đất n&agrave;y.&nbsp;<a href=\"http://dothihaiphong.vn/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; background-color: transparent; color: rgb(51, 51, 51); text-decoration-line: none; transition: all 0.3s ease 0s;\">Khu đ&ocirc; thị Vinhomes Riverside Hai Phong</a>&nbsp;được x&acirc;y dựng thể hiện quyết t&acirc;m Vingroup v&agrave;o thị trường BĐS tiềm năng Hải Ph&ograve;ng, thể hiện mong muốn ph&aacute;t triển HP trở th&agrave;nh &ldquo;Đ&ocirc; thị hiện đại &ndash; văn minh, bậc nhất tại Miền Bắc&rdquo; của ch&iacute;nh quyền v&agrave; người d&acirc;n th&agrave;nh phố.</p>\r\n\r\n<h2 style=\"text-align:justify\">Vinhomes Riverside sở hữu hạ tầng cơ sở hiện đại</h2>\r\n\r\n<p style=\"text-align:justify\">Nhắc đến Vinhomes l&agrave; nhắc tới những sản phẩm BĐS đẳng cấp tại c&aacute;c th&agrave;nh phố lớn do tập đo&agrave;n danh gi&aacute; Vingroup đầu tư. Một số thương hiệu BĐS th&agrave;nh c&ocirc;ng được nhiều người biết tới như: Vinhomes Times City, Vinhomes Royal City, Vinhomes Riverside&hellip;nhờ sở hữu hạ tầng đẳng cấp, nằm tr&ecirc;n c&aacute;c trụ đường giao th&ocirc;ng huyết mạch. Trong tương lai kh&ocirc;ng xa, một sản phẩm BĐS uy t&iacute;n như vậy sẽ c&oacute; mặt tại Hải Ph&ograve;ng.</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"Trung tâm thương mại Vinhomes Riverside Hải Phòng\" src=\"http://batdongsanhaiphong.net/images/Upload/images/trung-tam-thuong-mai-vinhomes-riverside-hai-phong.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:334px; margin:0px auto; max-width:100%; padding:0px; vertical-align:middle; width:601px\" title=\"Trung tâm thương mại Vinhomes Riverside Hải Phòng\" /></p>\r\n\r\n<p style=\"text-align:center\">Trung t&acirc;m thương mại Vinhomes Riverside Hải Ph&ograve;ng</p>\r\n\r\n<p style=\"text-align:justify\">Khu đ&ocirc; thị Vinhomes Riverside Hải Ph&ograve;ng hội tụ đầy đủ c&aacute;c yếu tố đắc địa v&agrave; sẵn s&agrave;ng l&agrave;m n&ecirc;n cơn sốt tại bất kỳ thời điểm n&agrave;o. Tổ hợp cao ốc &ndash; biệt thự &ndash; liền kề Vinhomes HP hứa hẹn sẽ đem tới diện mạo mới cho th&agrave;nh phố, đ&aacute;p ứng mong mỏi của người d&acirc;n HP v&agrave; quyết t&acirc;m l&acirc;n s&acirc;u v&agrave;o thị trường tiềm năng của tập đo&agrave;n Vingroup.</p>\r\n',	'hp11.jpg',	1,	'Tòa nhà cao nhất Hải Phòng sắp được xây dựng',	'',	'',	'',	'',	'2019-07-30 04:15:56',	1,	7),
(22,	'Những diễn biến mới của phân khúc Biệt thự, liền kề',	'',	'Những diễn biến mới của phân khúc Biệt thự, liền kề\r\n',	'<div class=\"brief_news_page\" style=\"box-sizing: border-box; margin: 0px 0px 10px; padding: 0px; border: 0px; font-weight: 600; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">\r\n<p>Nguồn cung biệt thự v&agrave; liền kề&nbsp;<a href=\"http://dothihaiphong.vn/nha-mat-duong-c7.htm\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; background-color: transparent; color: rgb(51, 51, 51); text-decoration-line: none; transition: all 0.3s ease 0s;\">H&agrave; Nội</a>&nbsp;từ nay đến cuối năm dự b&aacute;o sẽ b&ugrave;ng nổ khoảng 3.000 căn, trong khi tại Tp.HCM giao dịch th&agrave;nh c&ocirc;ng tăng đột biến.</p>\r\n</div>\r\n\r\n<div class=\"content_news_page\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; color: rgb(0, 0, 0); font-family: Roboto, sans-serif;\">\r\n<p style=\"text-align:justify\"><em>T&oacute;m tắt:</em></p>\r\n\r\n<p style=\"text-align:justify\"><em>-<a href=\"http://dothihaiphong.vn/tinh-hinh-thi-truong-bat-dong-san\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; background-color: transparent; color: rgb(51, 51, 51); text-decoration-line: none; transition: all 0.3s ease 0s;\">Thị trường biệt thự v&agrave; liền kề</a>&nbsp;tại Tp.HCM v&agrave; H&agrave; Nội đang c&oacute; những chuyển động mới. Nguồn cung ch&agrave;o b&aacute;n tại Tp.HCM tăng đột biến gấp gần 7 lần năm ngo&aacute;i, c&ograve;n tại H&agrave; Nội nhiều dự &aacute;n mới mở b&aacute;n khả quan.</em></p>\r\n\r\n<p style=\"text-align:justify\"><em>-Tuy nhi&ecirc;n, trong 3 qu&yacute; c&ograve;n lại với kế hoạch mở b&aacute;n rầm rộ từ nhiều dự &aacute;n, nguồn cung mới dự kiến tăng mạnh khoảng 3.000 căn sẽ l&agrave; th&aacute;ch thức đối với mảng thị trường n&agrave;y.</em></p>\r\n\r\n<hr />\r\n<p style=\"text-align:justify\">Những t&iacute;n hiệu n&agrave;y cho thấy thị trường bất động sản mảng biệt thự v&agrave; liền kề đang c&oacute; sự khởi sắc hơn so với năm ngo&aacute;i. Tuy nhi&ecirc;n, liệu thị trường n&agrave;y c&oacute; v&agrave;o đợt &ldquo;s&oacute;ng mới&rdquo; hay kh&ocirc;ng c&ograve;n phụ thuộc v&agrave;o nhiều yếu tố.</p>\r\n\r\n<p style=\"text-align:justify\">&ldquo;Động đậy&rdquo; trở lại</p>\r\n\r\n<p style=\"text-align:justify\">Kể từ khi lập đỉnh v&agrave;o qu&yacute; 1 năm &nbsp;2011, bong b&oacute;ng biệt thự v&agrave; liền kề bắt đầu x&igrave; hơi khiến gi&aacute; b&aacute;n biệt thự v&agrave; liền kề ở c&aacute;c khu đ&ocirc; thị ven đ&ocirc; suy giảm mạnh, c&oacute; dự &aacute;n giảm tới 50%.</p>\r\n\r\n<p style=\"text-align:justify\">Từ đ&oacute;, thanh khoản tr&ecirc;n thị trường rất thấp, gần như &ldquo;đ&oacute;ng băng&rdquo;, biến động gi&aacute; trung b&igrave;nh tr&ecirc;n thị trường thất thường. Trong 2 qu&yacute; trở lại đ&acirc;y bắt đầu c&oacute; t&iacute;n hiệu khởi động lại từ một v&agrave;i dự &aacute;n nhưng chưa r&otilde; r&agrave;ng. Tuy nhi&ecirc;n, cũng đ&atilde; c&oacute; những dấu hiệu khởi sắc, theo ghi nhận của CBRE, c&aacute;c dự &aacute;n được mở b&aacute;n v&agrave;o thời điểm cuối năm 2014 đều đạt tỷ lệ b&aacute;n kh&aacute; tốt, nhờ c&oacute; uy t&iacute;n của chủ đầu tư cũng như mức độ cung ứng đầy đủ c&aacute;c yếu tố về cơ sở hạ tầng, tiện &iacute;ch trong khu đ&ocirc; thị, c&ugrave;ng với dịch vụ quản l&yacute; vận h&agrave;nh chuy&ecirc;n nghiệp.</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://batdongsanhaiphong.net/images/Upload/images/thi-truong-biet-thu-lien-ke-buoc-vao-chu-ky-moi.jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:323px; margin:0px auto; max-width:100%; padding:0px; vertical-align:middle; width:640px\" /></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11px\"><a href=\"http://dothihaiphong.vn/tinh-hinh-thi-truong-bat-dong-san/nhung-dien-bien-moi-cua-phan-khuc-biet-thu-lien-ke-n85.htm\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; background-color: transparent; color: rgb(51, 51, 51); text-decoration-line: none; transition: all 0.3s ease 0s;\">Diễn biến thị trường biệt thự v&agrave; liền kề</a>-Theo số liệu CBRE</span></p>\r\n\r\n<p style=\"text-align:justify\">Trong thời kỳ bất động sản khởi sắc trở lại th&igrave; nh&agrave; ở biệt thự v&agrave; liền kề lu&ocirc;n được quan t&acirc;m h&agrave;ng đầu của người mua nh&agrave;. Chắc hẳn những ai quan t&acirc;m đến thị trường nh&agrave; đất chu kỳ 2006-2011 đ&atilde; thấy r&otilde; điều n&agrave;y. Khi đ&oacute;, thị trường địa ốc H&agrave; Nội lu&ocirc;n &ldquo;s&ocirc;i sục&rdquo; với c&aacute;c dự &aacute;n khu đ&ocirc; thị, đặc biệt l&agrave; ph&iacute;a T&acirc;y Thủ đ&ocirc;. Gi&aacute; biệt thự, liền kề &ldquo;nhảy m&uacute;a&rdquo; từng ng&agrave;y khiến &ldquo;bong b&oacute;ng&rdquo; bất động sản b&ugrave;ng nổ v&agrave; x&igrave; hơi v&agrave;o giữa 2011.</p>\r\n\r\n<p style=\"text-align:justify\">Với phong tr&agrave;o t&acirc;m l&yacute; đ&aacute;m đ&ocirc;ng, nh&agrave; nh&agrave; người người đầu tư bất động sản khiến thị trường c&oacute; tới 70-80% l&agrave; giới đầu tư, đầu cơ. Cho đến nay, thậm ch&iacute; nhiều nh&agrave; đầu tư vẫn c&ograve;n mắc kẹt ở rất nhiều dự &aacute;n.</p>\r\n\r\n<p style=\"text-align:justify\">V&igrave; thế, đặc điểm khởi sắc của thị trường địa ốc lần n&agrave;y m&agrave; giới chuy&ecirc;n gia đ&aacute;nh gi&aacute; l&agrave; thời điểm bắt đầu của chu kỳ mới, th&igrave; phần lớn lại nằm ở ph&acirc;n kh&uacute;c căn hộ. Mảng biệt thự, liền kề gần như &ldquo;chết lặng&rdquo; trong nhiều qu&yacute; vừa qua.</p>\r\n\r\n<p style=\"text-align:justify\">Tuy nhi&ecirc;n, hiện nay theo b&aacute;o c&aacute;o thị trường qu&yacute; 1/2015 của C&ocirc;ng ty CBRE Việt Nam cho thấy, thị trường biệt thự v&agrave; liền kề H&agrave; Nội đang rục rịch chuyển biến về giao dịch v&agrave; gi&aacute; b&aacute;n, cũng như nguồn cung trong 3 qu&yacute; tới.</p>\r\n\r\n<p style=\"text-align:justify\">Theo CBRE, thị trường thứ cấp trong qu&yacute; vừa qua đ&atilde; c&oacute; dấu hiệu nh&uacute;c nh&iacute;ch tăng của gi&aacute; biệt thự v&agrave; liền kề từ 1,3% so với hồi cuối năm 2014. Một số khu vực l&acirc;n cận khu trung t&acirc;m như H&agrave; Đ&ocirc;ng, Ho&agrave;i Đức, Gia L&acirc;m, Ho&agrave;ng Mai,&hellip;được đầu tư mạnh về hạ tầng x&atilde; hội, trong đ&oacute;, quận Gia L&acirc;m c&oacute; mức tăng cao nhất l&ecirc;n đến 5%.</p>\r\n\r\n<p style=\"text-align:justify\">Trong khi, thị trường H&agrave; Nội mới đang c&oacute; t&iacute;n hiệu &ldquo;nh&uacute;c nh&iacute;ch&rdquo; trở lại th&igrave; Tp.HCM lại c&oacute; những t&iacute;n hiệu giao dịch b&ugrave;ng nổ hơn. Theo ghi nhận từ Savills, qu&yacute; 1/2015 nh&agrave; biệt thự v&agrave; liền kề tăng gần 7 lần so với năm trước. Hấp thụ tr&ecirc;n thị trường kh&aacute; tốt ở mức 32%</p>\r\n\r\n<p style=\"text-align:justify\">Nguồn cung lớn chờ thị trường</p>\r\n\r\n<p style=\"text-align:justify\">Sau khi mảng căn hộ c&oacute; sự đột ph&aacute; về t&iacute;nh thanh khoản, lượng giao dịch trong những th&aacute;ng đầu năm 2015 tăng cao, nhiều chủ đầu tư v&agrave; s&agrave;n giao dịch địa ốc đ&atilde; bắt đầu hướng đến những&nbsp;<a href=\"http://dothihaiphong.vn/\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; background-color: transparent; color: rgb(51, 51, 51); text-decoration-line: none; transition: all 0.3s ease 0s;\">dự &aacute;n khu đ&ocirc; thị mới</a>&nbsp;khu vực v&ugrave;ng ven trung t&acirc;m.</p>\r\n\r\n<p style=\"text-align:justify\">Một số chủ dự &aacute;n đ&atilde; c&oacute; kế hoạch tung sản phẩm biệt thự, liền kề ra thị trường năm nay. Một nguồn tin từ đại diện&nbsp;<a href=\"http://dothihaiphong.vn/nha-mat-duong-c7.htm\" style=\"box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; background-color: transparent; color: rgb(51, 51, 51); text-decoration-line: none; transition: all 0.3s ease 0s;\">Park City (H&agrave; Đ&ocirc;ng)</a>&nbsp;cho biết, hiện c&ocirc;ng ty đang chuẩn bị kế hoạch b&aacute;n 165 căn liền kề giai đoạn 2 ra thị trường, v&agrave; sự quan t&acirc;m của kh&aacute;ch h&agrave;ng cũng kh&aacute; tốt khi c&oacute; khoảng 200 đơn đăng k&yacute; mua.</p>\r\n\r\n<p style=\"text-align:justify\">Mới đ&acirc;y, CTCP Lũng L&ocirc; 5 cũng đ&atilde; giới thiệu sản phẩm đất nền nh&agrave; liền kề, biệt thự tại Dự &aacute;n Nam đường 32-Wespoint (huyện Ho&agrave;i Đức) ra thị trường.</p>\r\n\r\n<p style=\"text-align:center\"><img alt=\"\" src=\"http://batdongsanhaiphong.net/images/Upload/images/thi-truong-biet-thu-lien-ke-buoc-vao-chu-ky-moi%20(1).jpg\" style=\"border:0px; box-sizing:border-box; display:block; height:389px; margin:0px auto; max-width:100%; padding:0px; vertical-align:middle; width:640px\" /></p>\r\n\r\n<p style=\"text-align:center\"><span style=\"font-size:11px\">Ph&acirc;n bổ nguồn cung biệt thự v&agrave; liền kề tại H&agrave; Nội</span></p>\r\n\r\n<p style=\"text-align:justify\">Tại b&aacute;o c&aacute;o thị trường của CBRE qu&yacute; 1/2015, đơn vị n&agrave;y đưa ra th&ocirc;ng tin rất đ&aacute;ng ch&uacute; &yacute; ở mảng biệt thự v&agrave; liền kề đ&oacute; l&agrave; kế hoạch ch&agrave;o h&agrave;ng của h&agrave;ng loạt dự &aacute;n như The Manor Central Park (với 80 căn, dự kiến mở b&aacute;n v&agrave;o th&aacute;ng 5/2015); Dự &aacute;n Park City giai đoạn 2 (với 165 căn, được mở b&aacute;n v&agrave;o qu&yacute; II/2015); Dự &aacute;n Nam đường 32- Wespoint (với 1.746 căn, dự kiến mở b&aacute;n v&agrave;o qu&yacute; III/2015); Dự &aacute;n FLC Garden (với 140 căn, dự kiến mở b&aacute;n v&agrave;o qu&yacute; II/2015).</p>\r\n\r\n<p style=\"text-align:justify\">Với h&agrave;ng loạt dự &aacute;n n&agrave;y, CBRE kỳ vọng trong 3 qu&yacute; tới sẽ c&oacute; khoảng 3.000 căn biệt thự liền kề được tung ra thị trường</p>\r\n\r\n<p style=\"text-align:justify\">Tại Tp.HCM thị trường giao dịch tốt cũng khiến c&aacute;c chủ đầu tư bung h&agrave;ng rầm rộ. Nguồn cung mới qu&yacute; 1/2015 v&agrave;o khoảng 1.100 căn tăng 319% so với năm ngo&aacute;i. Dự b&aacute;o của đơn vị n&agrave;y cho thấy, c&aacute;c qu&yacute; sau của năm 2015, ước t&iacute;nh sẽ c&oacute; ch&iacute;n dự &aacute;n với 1.400 nền/căn gia nhập thị trường. Quận 9 c&oacute; nguồn cung lớn nhất, chiếm 60% thị phần.</p>\r\n</div>\r\n',	'aaaaaaaaa.jpg',	0,	'Những diễn biến mới của phân khúc Biệt thự, liền kề',	'',	'',	'',	'',	'2019-07-30 04:16:43',	1,	7);
INSERT INTO `price` (`id`, `name`, `content`, `img`, `intro`) VALUES
(2,	'Phương thức đăng bài',	'<p><strong><span style=\"font-size:16px\">Lĩnh vực bất động sản:</span></strong></p>\r\n\r\n<p><span style=\"font-family:tahoma,geneva,sans-serif\"><span style=\"font-size:14px\">C&ocirc;ng ty <strong>TNHH Thương mại dịch vụ T&acirc;n B&igrave;nh</strong> đăng tin tr&ecirc;n 60 trang web lớn về bđs như : BDS .com , muaban .net , nhadat24h, alonhadat,&hellip; ( up tin 1 tuần 4 lần ,để giao dịch th&agrave;nh c&ocirc;ng v&agrave; kh&ocirc;ng bị tr&ocirc;i)</span></span></p>\r\n\r\n<ol>\r\n	<li><span style=\"font-family:tahoma,geneva,sans-serif\"><span style=\"font-size:14px\">G&oacute;i tin vip in đậm /30 trang BĐS</span></span></li>\r\n	<li><span style=\"font-family:tahoma,geneva,sans-serif\"><span style=\"font-size:14px\">G&oacute;i tin HOT VIP&nbsp; k&egrave;m 6, 8 h&igrave;nh ảnh/30 trang BĐS</span></span></li>\r\n	<li><span style=\"font-family:tahoma,geneva,sans-serif\"><span style=\"font-size:14px\">G&oacute;i tin VIP HOT +Zalo v&agrave; hội nh&oacute;m facebook /30 trang BĐS(để tiếp cận kh&aacute;ch h&agrave;ng nhiều hơn)</span></span></li>\r\n</ol>\r\n\r\n<p><strong><span style=\"font-family:tahoma,geneva,sans-serif\"><span style=\"font-size:14px\">Ngo&agrave;i ra c&ograve;n c&aacute;c g&oacute;i baner treo cố định cho hiệu quả nhanh hơn&nbsp; đăng tr&ecirc;n 60 trang bất động sản</span></span></strong></p>\r\n\r\n<ol>\r\n	<li><span style=\"font-family:tahoma,geneva,sans-serif\"><span style=\"font-size:14px\">G&oacute;i baner tr&aacute;i.</span></span></li>\r\n	<li><span style=\"font-family:tahoma,geneva,sans-serif\"><span style=\"font-size:14px\">G&oacute;i&nbsp; baner phải.</span></span></li>\r\n	<li><span style=\"font-family:tahoma,geneva,sans-serif\"><span style=\"font-size:14px\">G&oacute;i&nbsp; baner giữa.</span></span></li>\r\n	<li><span style=\"font-family:tahoma,geneva,sans-serif\"><span style=\"font-size:14px\">G&oacute;i&nbsp; baner cao nhất v&agrave; k&iacute;ch thước lớn nhất .</span></span></li>\r\n	<li><span style=\"font-family:tahoma,geneva,sans-serif\"><span style=\"font-size:14px\">Đồng thời đăng tr&ecirc;n c&aacute;c mục HOT+VIP,facebook,zalo&hellip;</span></span></li>\r\n	<li><span style=\"font-family:tahoma,geneva,sans-serif\"><span style=\"font-size:14px\">Sau khi k&iacute;ch tin , ch&uacute;ng t&ocirc;i sẽ cập nhật tất cả đường link ,số lượng trang theo từng g&oacute;i để KH kiểm tra</span></span></li>\r\n</ol>\r\n\r\n<p><span style=\"font-family:tahoma,geneva,sans-serif\"><span style=\"font-size:14px\"><strong>C&aacute;c dịch vụ ch&iacute;nh</strong>:</span></span></p>\r\n\r\n<ol>\r\n	<li><span style=\"font-family:tahoma,geneva,sans-serif\"><span style=\"font-size:14px\">- Đăng th&ocirc;ng tin quảng c&aacute;o nh&agrave; đất;</span></span></li>\r\n	<li><span style=\"font-family:tahoma,geneva,sans-serif\"><span style=\"font-size:14px\">- Đăng banner quảng c&aacute;o;</span></span></li>\r\n	<li><span style=\"font-family:tahoma,geneva,sans-serif\"><span style=\"font-size:14px\">- Đăng b&agrave;i PR quảng b&aacute; sản phẩm, dịch vụ;</span></span></li>\r\n	<li><span style=\"font-family:tahoma,geneva,sans-serif\"><span style=\"font-size:14px\">- Danh bạ doanh nghiệp;</span></span></li>\r\n	<li><span style=\"font-family:tahoma,geneva,sans-serif\"><span style=\"font-size:14px\">- Danh bạ c&aacute;c nh&agrave; m&ocirc;i giới nh&agrave; đất số 1 Việt Nam</span></span></li>\r\n</ol>\r\n\r\n<p><span style=\"font-family:tahoma,geneva,sans-serif\"><span style=\"font-size:14px\">Mọi th&ocirc;ng tin chi tiết c&aacute;c g&oacute;i, qu&yacute; kh&aacute;ch vui l&ograve;ng li&ecirc;n hệ CSKH để biết th&ecirc;m chi tiết.</span></span></p>\r\n',	'',	''),
