INSERT INTO `product` (`id`, `name`, `content`, `img`, `intro`) VALUES
(1,	'Về chúng tôi',	'<p><span style=\"font-size:14px\"><span style=\"font-family:tahoma,geneva,sans-serif\">Được th&agrave;nh lập v&agrave;o năm 2015,&nbsp;<strong>C&ocirc;ng ty TNHH Thương Mại &amp; Dịch Vụ T&acirc;n B&igrave;nh(</strong>TanBinhCorp<strong>)</strong>&nbsp;l&agrave; c&ocirc;ng ty ti&ecirc;n phong trong lĩnh vực c&ocirc;ng nghệ v&agrave; nội dung số. Với hơn 4 năm h&igrave;nh th&agrave;nh v&agrave; ph&aacute;t triển,&nbsp;TanBinhCorp&nbsp;đ&atilde; x&acirc;y dựng được một hệ sinh th&aacute;i Internet rộng lớn với rất nhiều sản phẩm s&aacute;ng tạo, hữu &iacute;ch trong nhiều lĩnh vực (quảng c&aacute;o trực tuyến, thương mại điện tử, tr&ograve; chơi trực tuyến...) phủ s&oacute;ng tr&ecirc;n 90% người sử dụng Internet v&agrave; mobile, c&oacute; gi&aacute; trị đ&oacute;ng g&oacute;p lớn v&agrave;o sự ph&aacute;t triển của Internet Việt Nam trong một thập kỷ qua.</span></span></p>\r\n\r\n<p style=\"text-align: center;\"><img alt=\"\" src=\"/upload/anhchitiet/images/about_us_2.jpg\" style=\"height:194px; width:259px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:tahoma,geneva,sans-serif\">TanBinh Corp hiện đang sở hữu thương hiệu quảng c&aacute;o trực tuyến&nbsp; l&agrave; đơn vị quảng c&aacute;o trực tuyến lớn nhất hiện nay với hệ thống quảng c&aacute;o tr&ecirc;n 200 website uy t&iacute;n h&agrave;ng đầu<br />\r\nVới độ phủ tới tr&ecirc;n 50 triệu độc giả, tương đương 90% người d&ugrave;ng Internet v&agrave; mobile tại Việt Nam, c&ugrave;ng với sức mạnh về c&ocirc;ng nghệ, v&agrave; sự s&aacute;ng tạo<br />\r\nkh&ocirc;ng ngừng, </span></span><span style=\"font-family:tahoma,geneva,sans-serif; font-size:14px\">TanBinh Corp&nbsp;</span><span style=\"font-size:14px\"><span style=\"font-family:tahoma,geneva,sans-serif\">lu&ocirc;n ở vị thế dẫn đầu thị trường, gi&uacute;p c&aacute;c trang b&aacute;o v&agrave; trang th&ocirc;ng tin điện tử Việt Nam<br />\r\nc&oacute; nguồn thu tốt để cung cấp th&ocirc;ng tin cho người d&acirc;n v&agrave; cạnh tranh được c&aacute;c website dịch vụ nước ngo&agrave;i.</span></span></p>\r\n',	'banner19.png',	'TanBinhCorp – Sự hình thành và phát triển'),
(2,	'Đăng Tin',	'<p><strong><span style=\"font-size:14px\"><span style=\"font-family:tahoma,geneva,sans-serif\"><span style=\"background-color:rgb(245, 247, 251); color:rgb(34, 34, 34)\">Việc đăng tin b&aacute;n, cho thu&ecirc; chiếm nhiều thời gian của chủ nh&agrave;. Vậy tại sao kh&ocirc;ng để #TanBinh đăng tin l&ecirc;n nhiều nơi gi&uacute;p bạn ?</span></span></span></strong></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:tahoma,geneva,sans-serif\">Đăng tin 50 web bất động sản lớn nhất Việt Nam.</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:tahoma,geneva,sans-serif\">12 g&oacute;i tin VIP được tối ưu h&oacute;a, hiệu quả cao.</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:tahoma,geneva,sans-serif\">L&agrave;m mới, up tin miễn ph&iacute; v&agrave;o 9h s&aacute;ng hằng ng&agrave;y.</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:tahoma,geneva,sans-serif\">Tin được đăng tỉ mẩn, kh&ocirc;ng c&ocirc;ng nghệ tự động.</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:tahoma,geneva,sans-serif\">C&ocirc;ng cụ web quản l&yacute; tin đ&atilde; đăng chi tiết, minh bạch.</span></span></p>\r\n\r\n<p><span style=\"font-size:14px\"><span style=\"font-family:tahoma,geneva,sans-serif\"><strong>#Web ti&ecirc;u biểu</strong><span style=\"background-color:rgb(245, 247, 251); color:rgb(34, 34, 34)\">&nbsp;: B&aacute;o mua b&aacute;n&nbsp;</span><span style=\"background-color:rgb(245, 247, 251); color:red\">(VIP đặc biệt)</span><span style=\"background-color:rgb(245, 247, 251); color:rgb(34, 34, 34)\">, Chợ tốt&nbsp;</span><span style=\"background-color:rgb(245, 247, 251); color:red\">(Tin đặc biệt, đẩy Top 1)</span><span style=\"background-color:rgb(245, 247, 251); color:rgb(34, 34, 34)\">, Bất động sản&nbsp;</span><span style=\"background-color:rgb(245, 247, 251); color:red\">(VIP2, VIP3)</span><span style=\"background-color:rgb(245, 247, 251); color:rgb(34, 34, 34)\">, Rồng bay&nbsp;</span><span style=\"background-color:rgb(245, 247, 251); color:red\">(Đẩy TOP theo giờ)</span><span style=\"background-color:rgb(245, 247, 251); color:rgb(34, 34, 34)\">, Đ&ocirc; thị</span><span style=\"background-color:rgb(245, 247, 251); color:red\">(Tin HOT)</span><span style=\"background-color:rgb(245, 247, 251); color:rgb(34, 34, 34)\">, Alo nh&agrave; đất, Vật Gi&aacute;, Homedy, Mua b&aacute;n nh&agrave; đất, 5 gi&acirc;y, CafeLand, Nhadat24h.net ..</span></span></span></p>\r\n',	'12',	'ĐĂNG TIN BĐS GIÚP CHỦ NHÀ');
